(1, 1, 'DIETAS (INHABILITADA)', 'ASIGNACIONES DESTINADAS A CUBRIR REMUNERACIONES A LOS MIEMBROS DEL HONORABLE CONGRESO DEL ESTADO E INSTITUTO ESTATAL ELECTORAL Y DE PARTICIPACION CIUDADANA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 1),
(2, 2, 'HABERES', 'CANTIDAD DESTINADA A CUBRIR LAS REMUNERACIONES AL PERSONAL DE TROPA Y OFICIALIDAD DE LAS CORPORACIONES DE: POLICIA ESTATAL, POLICIA AUXILIAR BANCARIA, INDUSTRIAL Y COMERCIAL, BOMBEROS Y VIALIDAD DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 2),
(3, 3, 'RETROACTIVO DE SUELDOS APC PARA HABERES', 'CANTIDAD DESTINADA A CUBRIR EL SUELDO RETROACTIVO AL PERSONAL DE HABERES DEL GOBIERNO DEL ESTADO, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 2),
(4, 4, 'SUELDOS PARA BASE', 'IMPORTE DESTINADO A CUBRIR REMUNERACIONES POR CONCEPTO DE SUELDO BASE Y DIAS DE AJUSTE ANUAL, AL PERSONAL DE LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO QUE CUENTE CON NOMBRAMIENTO DE BASE,  CONFORME AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 3),
(5, 5, 'SUELDOS PARA MMyS', 'CANTIDAD DESTINADA A CUBRIR LAS REMUNERACIONES BASICAS Y DIAS DE AJUSTE DEL PERSONAL DE MANDOS MEDIOS Y SUPERIORES, DE LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO,  DE ACUERDO AL TABULADOR DE SUELDOS Y CATALOGO DE PUESTOS VIGENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 3),
(6, 6, 'SUELDOS PARA CONFIANZA', 'IMPORTE DESTINADO A CUBRIR REMUNERACIONES POR CONCEPTO DE SUELDO Y DIAS DE AJUSTE ANUAL, AL PERSONAL DE LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO QUE CUENTE CON NOMBRAMIENTO DE CONFIANZA,  CONFORME AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 3),
(7, 10, 'RETROACTIVO DE SUELDOS APC PARA BASE', 'CANTIDAD DESTINADA A CUBRIR EL SUELDO RETROACTIVO AL PERSONAL DE BASE DE LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 3),
(8, 11, 'RETROACTIVO DE SUELDOS APC PARA MMyS', 'CANTIDAD DESTINADA A CUBRIR EL SUELDO RETROACTIVO AL PERSONAL DE MANDOS MEDIOS Y SUPERIORES DE LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 3),
(9, 12, 'RETROACTIVO DE SUELDOS APC PARA CONFIANZA', 'CANTIDAD DESTINADA A CUBRIR EL SUELDO RETROACTIVO AL PERSONAL DE CONFIANZA DE LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 3),
(10, 13, 'SUELDOS A PERSONAL ADSCRITO EN EL EXTRANJERO', 'ASIGNACIONES DESTINADAS A CUBRIR LAS REMUNERACIONES DEL PERSONAL QUE LABORA EN REPRESENTACIONES ESTATALES EN EL EXTRANJERO. INCLUYE LAS VARIACIONES DEL FACTOR DE AJUSTE: IMPORTANCIA RELATIVA DE LA OFICINA DE ADSCRIPCION; COSTO DE LA VIDA EN EL LUGAR DE ADSCRIPCION Y CONDICIONES DE DIFICULTAD DE LA VIDA EN CADA ADSCRIPCION. DICHAS REMUNERACIONES SON CUBIERTAS EXCLUSIVAMENTE AL PERSONAL QUE LABORE EN ESAS REPRESENTACIONES EN EL EXTERIOR.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 4),
(11, 14, 'HONORARIOS ASIMILABLES A SALARIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO POR LA PRESTACION DE SERVICIOS CONTRATADOS POR LAS DEPENDENCIAS CON PERSONAS FISICAS, COMO PROFESIONISTAS, TECNICOS, EXPERTOS Y PERITOS, ENTRE OTROS, POR ESTUDIOS, OBRAS O TRABAJOS DETERMINADOS QUE CORRESPONDAN A SU ESPECIALIDAD. EL PAGO DE HONORARIOS DEBERA SUJETARSE A LAS DISPOSICIONES APLICABLES. ESTA PARTIDA EXCLUYE LOS SERVICIOS PROFESIONALES CONTRATADOS CON PERSONAS FISICAS O MORALES PREVISTOS EN EL CAPITULO 3000 SERVICIOS GENERALES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 5),
(12, 15, 'SUELDOS PARA CONTRATO', 'IMPORTE QUE SE DESTINA PARA CUBRIR REMUNERACIONES POR CONCEPTO DE SUELDO Y DIAS DE AJUSTE  AL PERSONAL QUE ESTA SUJETO A UN CONTRATO INDIVIDUAL DE TRABAJO POR TIEMPO DETERMINADO CON LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 6),
(13, 16, 'RETROACTIVO DE SUELDOS APC PARA CONTRATO', 'CANTIDAD DESTINADA A CUBRIR EL SUELDO RETROACTIVO AL PERSONAL DE CONTRATO DE LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 6),
(14, 17, 'SUELDOS PARA CONTRATO CONFIANZA', 'IMPORTE QUE SE DESTINA A CUBRIR REMUNERACIONES POR CONCEPTO DE SUELDO Y DIAS DE AJUSTE AL PERSONAL QUE ESTA SUJETO A UNA RELACION LABORAL DE CONTRATO CONFIANZA E  INDIVIDUAL DE TRABAJO CON LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 6),
(15, 18, 'RETROACTIVO DE SUELDOS APC PARA CONTRATO CONFIANZA', 'CANTIDAD DESTINADA A CUBRIR EL SUELDO RETROACTIVO AL PERSONAL DE CONTRATO CONFIANZA DE LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 6),
(16, 19, 'RETRIBUCIONES POR SERVICIOS DE CARACTER SOCIAL', 'REMUNERACION A PROFESIONISTAS O ESTUDIANTES DE LAS DIVERSAS CARRERAS O ESPECIALIDADES TECNICAS QUE PRESTEN SU SERVICIO SOCIAL EN LAS DEPENDENCIAS. CONSIDERANDO UNICAMENTE EL PERIODO QUE LA NORMATIVIDAD ESTABLECE PARA ESTE TIPO DE SERVICIO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 7),
(17, 20, 'RETRIBUCION DE LOS REPRESENTANTES DE LOS TRABAJADORES Y PATRONES EN LA JUNTA DE CONCILIACION Y ARBITRAJE', 'ASIGNACIONES DESTINADAS A CUBRIR LAS  RETRIBUCIONES DE LOS REPRESENTANTES DE LOS TRABAJADORES Y DE LOS PATRONES EN LA JUNTA DE CONCILIACION Y ARBITRAJE, DURANTE EL TIEMPO POR EL CUAL FUERON ELEGIDOS POR LA CONVENCION CORRESPONDIENTE, CONFORME A LO DISPUESTO POR LA LEY FEDERAL DEL TRABAJO. ESTA PARTIDA NO ESTARA SUJETA AL PAGO DE LAS CUOTAS Y APORTACIONES POR CONCEPTO DE SEGURIDAD SOCIAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 8),
(18, 21, 'QUINQUENIOS PARA BASE', 'CANTIDAD DESTINADA A CUBRIR LA PRIMA QUE SE OTORGA A LOS TRABAJADORES DEL GOBIERNO DEL ESTADO CON NOMBRAMIENTO DE BASE, POR CADA CINCO AÑOS DE SERVICIO CONTINUO O SUS MULTIPLOS, COMO COMPLEMENTO AL SALARIO, SEGUN TABULADOR VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 9),
