(51, 57, 'ASIGNACIONES DE TECNICO, DE MANDO, POR COMISION, DE  VUELO Y DE TECNICO ESPECIAL', 'REMUNERACIONES A LOS MIEMBROS DEL EJERCITO, FUERZA AEREA Y ARMADA NACIONALES, TITULADOS EN PROFESIONES DE LOS DISTINTOS SERVICIOS MILITARES, POR EL DESEMPEÑO DE COMISIONES DENTRO DEL RAMO Y QUE PERTENEZCAN A LA MILICIA PERMANENTE; REMUNERACIONES A GENERALES, JEFES Y OFICIALES INVESTIDOS CONFORME A LAS LEYES Y ORDENANZAS DEL MANDO MILITAR, DE UNA CORPORACION DEL EJERCITO O DE UNA UNIDAD DE LA ARMADA. SU CUOTA NO PODRA VARIAR DURANTE EL EJERCICIO FISCAL RESPECTIVO. REMUNERACIONES A LOS MIEMBROS DEL EJERCITO Y LA ARMADA POR EL DESEMPEÑO DE UNA COMISION QUE NO SEA LA PROPIA DE SU CARGO, COMO EN LOS ESTADOS MAYORES DE LOS SECRETARIOS Y SUBSECRETARIOS, AYUDANTIA DEL OFICIAL MAYOR Y JEFES DE SECCION DE LOS DIVERSOS DEPARTAMENTOS DE LA SECRETARIA DE LA DEFENSA NACIONAL Y AYUDANTIA DE LOS FUNCIONARIOS SUPERIORES DE LA SECRETARIA DE MARINA; REMUNERACIONES A LOS MIEMBROS DEL EJERCITO Y LA ARMADA, QUE HABITUALMENTE DESEMPEÑAN SERVICIOS EN UNIDADES AEREAS DE LAS FUERZAS ARMADAS MEXICANAS REMUNERACIONES COMPLEMENTARIAS A LOS HABERES DE LOS GENERALES DEL EJERCITO Y FUERZA AEREA, ASI COMO DE LOS ALMIRANTES DE LA ARMADA QUE SEAN AUTORIZADAS POR EL TITULAR DEL RAMO Y LAS QUE ESTE MISMO AUTORICE EN CASOS ESPECIALES PARA LOS JEFES Y OFICIALES DEL EJERCITO Y FUERZA AEREA, CAPITANES Y OFICIALES DE LA ARMADA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 14),
(52, 58, 'HONORARIOS ESPECIALES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS HONORARIOS QUE CORRESPONDAN A LOS REPRESENTANTES DE LA HACIENDA PUBLICA POR SU INTERVENCION EN LOS JUICIOS SUCESORIOS, SIEMPRE Y CUANDO EL IMPUESTO SE HUBIERE DETERMINADO CON BASE EN LA LIQUIDACION FORMULADA POR LOS MISMOS; A LOS NOTIFICADORES ESPECIALES EN EL COBRO DE IMPUESTOS, DERECHOS, MULTAS Y ARRENDAMIENTOS, ASI COMO A LOS AGENTES Y SUBAGENTES FISCALES Y POSTALES. COMPRENDE LAS REMUNERACIONES Y GASTOS DEL PERSONAL DESIGNADO PARA REALIZAR INSPECCIONES O INTERVENCIONES ESPECIALES, ASI COMO LOS PROGRAMAS DE PRESENCIA FISCAL. ESTAS ASIGNACIONES SE CUBRIRAN POR COMPROMISOS DEVENGADOS DURANTE EL AÑO Y NO SE ACEPTARAN LOS COMPROMISOS DE EJERCICIOS ANTERIORES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 15),
