(156, 201, 'MATERIALES, UTILES Y EQUIPOS MENORES DE OFICINA', 'ASIGNACIONES DESTINADAS A LA ADQUISICION DE MATERIALES, ARTICULOS DIVERSOS Y EQUIPOS MENORES PROPIOS PARA EL USO DE LAS OFICINAS TALES COMO: PAPELERIA, FORMAS, LIBRETAS, CARPETAS Y CUALQUIER TIPO DE PAPEL, LIMPIA TIPOS; UTILES DE ESCRITORIO COMO ENGRAPADORAS, PERFORADORAS MANUALES, SACAPUNTAS; ARTICULOS DE DIBUJO, CORRESPONDENCIA Y ARCHIVO; CESTOS DE BASURA Y OTROS PRODUCTOS SIMILARES. INCLUYE LA ADQUISICION DE ARTICULOS DE ENVOLTURA, SACOS Y VALIJAS, ENTRE OTROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 30),
