(158, 203, 'MATERIAL DE IMPRESION, FILMICO, DE INGENIERIA Y APOYO INFORMATIVO', 'ASIGNACIONES DESTINADAS A CUBRIR LA ADQUISICION DE MATERIALES UTILIZADOS EN LA IMPRESION, REPRODUCCION Y ENCUADERNACION, TALES COMO: FIJADORES, TINTAS, PASTAS, LOGOTIPOS; ASI MISMO,  MATERIAL  FILMICO, COMO CINTAS, GRABADORAS, CARTUCHOS, ROLLOS FOTOGRAFICOS, MATERIAL PARA REVELADO Y DUPLICADO; MATERIALES PARA LA ELABORACION DE PLANOS (TOPOGRAFICOS, ARQUITECTONICOS Y ESTRUCTURALES) QUE SE REQUIERAN PARA EL DESARROLLO DE LAS ACTIVIDADES DE LAS DEPENDENCIAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 31),
(159, 204, 'MATERIAL ESTADISTICO Y GEOGRAFICO', 'ASIGNACIONES DESTINADAS A LA ADQUISICION DE PUBLICACIONES RELACIONADAS CON INFORMACION ESTADISTICA Y GEOGRAFICA. SE INCLUYE LA CARTOGRAFIA Y PUBLICACIONES TALES COMO: LAS RELATIVAS A INDICADORES ECONOMICOS Y SOCIO DEMOGRAFICOS, CUENTAS NACIONALES, ESTUDIOS GEOGRAFICOS Y GEODESICOS, MAPAS, PLANOS, FOTOGRAFIAS AEREAS Y PUBLICACIONES RELACIONADAS CON INFORMACION ESTADISTICA Y GEOGRAFICA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 32),
(160, 205, 'MATERIALES, UTILES Y EQUIPOS MENORES DE TECNOLOGIAS DE LA  INFORMACION  Y  COMUNICACIONES', 'ASIGNACIONES DESTINADAS A LA ADQUISICION DE INSUMOS Y EQUIPOS MENORES UTILIZADOS PARA PROCESAR, GRABAR E IMPRIMIR INFORMACION, TALES COMO: PAPELERIA TECNICA, MEDIOS MAGNETICOS, MEDIOS OPTICOS, BIOMETRICOS, CINTAS, TONER, CARTUCHOS DE TINTA, PAPEL STOCK, ENTRE OTROS, ASI COMO MATERIALES PARA LA LIMPIEZA Y PROTECCION DE LOS EQUIPOS, TALES COMO: MEDIOS OPTICOS Y MAGNETICOS, APUNTADORES, PROTECTORES, FUNDAS, Y SOLVENTES, ENTRE OTROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 33),
(161, 206, 'MATERIALES IMPRESOS  E INFORMACION DIGITAL', 'ASIGNACIONES DESTINADAS A LA ADQUISICION DE TODA CLASE DE LIBROS, REVISTAS, PERIODICOS, PUBLICACIONES, DIARIOS OFICIALES, GACETAS, MATERIAL AUDIOVISUAL, CASETTES, DISCOS COMPACTOS DISTINTOS A LA ADQUISICION DE BIENES INTANGIBLES (SOFTWARE). INCLUYE LA SUSCRIPCION A REVISTAS Y PUBLICACIONES ESPECIALIZADAS, FOLLETOS, CATALOGOS, FORMATOS Y OTROS PRODUCTOS MEDIANTE CUALQUIER TECNICA DE IMPRESION Y SOBRE CUALQUIER TIPO DE MATERIAL. INCLUYE IMPRESION SOBRE PRENDAS DE VESTIR, PRODUCCION DE FORMAS CONTINUAS, IMPRESION RAPIDA, ELABORACION DE PLACAS, CLICHES, GRABADOS, RUTAS DE EVACUACION Y TODO TIPO DE SEÑALIZACION VIAL. EXCLUYE CONCEPTOS CONSIDERADOS EN LA PARTIDA MATERIAL ESTADISTICO Y GEOGRAFICO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 34),
