(254, 334, 'SERVICIOS DE COBRANZA', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE COBRANZA, QUE REQUIERAN LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO CON MOTIVO DE LAS FUNCIONES QUE REALIZA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 113),
(255, 335, 'SERVICIOS DE INVESTIGACION CREDITICIA Y SIMILARES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR INVESTIGACION CREDITICIA Y RECOPILACION DE INFORMACION SOBRE SOLVENCIA FINANCIERA DE PERSONAS O NEGOCIOS, QUE REQUIERAN LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO CON MOTIVO DE LAS FUNCIONES QUE REALIZA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 113),
(256, 332, 'COMISIONES Y SITUACIONES BANCARIAS', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DE TRASLADO, CUSTODIA DE VALORES Y SERVICIOS BANCARIOS NECESARIOS PARA EL MOVIMIENTO DE FONDOS. (SE EXCEPTUA EL PAGO DE COMISIONES POR SOBREGIRO).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 114),
(257, 336, 'SERVICIOS DE RECAUDACION, TRASLADO Y CUSTODIA DE VALORES', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE SERVICIOS FINANCIEROS POR GUARDA, CUSTODIA, TRASLADO DE VALORES Y OTROS GASTOS INHERENTES A LA RECAUDACION.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 114),
(258, 337, 'SEGUROS DE RESPONSABILIDAD PATRIMONIAL', 'ASIGNACIONES DESTINADAS A CUBRIR LAS PRIMAS CON CARGO AL PRESUPUESTO AUTORIZADO DE LOS ENTES PUBLICOS, POR CONCEPTO DE LA CONTRATACION DEL SEGURO DE RESPONSABILIDAD PATRIMONIAL DEL ESTADO, QUE PERMITA CON LA SUMA ASEGURADA CUBRIR EL MONTO EQUIVALENTE A LAS INDEMNIZACIONES Y QUE CORRESPONDERAN A LA REPARACION INTEGRAL DEL DAÑO Y, EN SU CASO, POR EL DAÑO PERSONAL Y MORAL, QUE SE OCASIONEN COMO CONSECUENCIA DE LA ACTIVIDAD ADMINISTRATIVA IRREGULAR DEL ESTADO. EXCLUYE EL MONTO DE LAS EROGACIONES QUE RESULTEN POR INSUFICIENCIA DE LA SUMA ASEGURADA CONTRA EL COSTO DE LA INDEMNIZACION Y, EN SU CASO, LOS DEDUCIBLES CORRESPONDIENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 115);
