(259, 338, 'SEGUROS POR CREDITOS', 'ASIGNACIONES DESTINADAS A CUBRIR  EL IMPORTE DE PRIMAS POR SEGUROS CONTRATADOS PARA GARANTIZAR EL PAGO SOBRE PRESTAMOS QUIROGRAFARIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 115),
(260, 339, 'FIANZAS PARA PRELIBERACION', 'DEPOSITOS AL FONDO DE PROCURACION DE JUSTICIA, QUE SE DERIVAN DE GARANTIAS O AFIANZAMIENTO DE INDICIADOS EN PROCESOS JUDICIALES PARA LA REPARACION DEL DAÑO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 115),
(261, 340, 'SEGUROS Y FIANZAS DE EQUIPO DE TRANSPORTE', 'ASIGNACIONES DESTINADAS A CUBRIR EL IMPORTE DE PRIMAS POR SEGUROS Y FIANZAS, CONTRATADOS A TERCEROS A FIN DE RESGUARDAR  CONTRA ROBOS, INCENDIOS Y  DEMAS RIESGOS O CONTINGENCIAS A QUE PUEDA ESTAR SUJETO EL EQUIPO DE TRANSPORTE REGISTRADO EN LOS ACTIVOS A CARGO DE LAS DEPENDENCIAS. SE EXCLUYE EL MONTO DE LOS DEDUCIBLES CORRESPONDIENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 116),
(262, 341, 'SEGUROS Y FIANZAS DE EDIFICIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL IMPORTE DE PRIMAS POR SEGUROS Y FIANZAS, CONTRATADOS A TERCEROS A FIN DE RESGUARDAR EL PATRIMONIO INMOBILIARIO A CARGO DE LAS DEPENDENCIAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 116),
(263, 342, 'PRIMAS DE SEGUROS Y FIANZAS', 'CANTIDADES  DESTINADAS A CUBRIR EL IMPORTE DE PRIMAS DE SEGUROS Y FIANZAS DE EQUIPO DE COMPUTO, BIENES ARTISTICOS, ENTRE OTROS QUE REQUIERAN LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO. SE EXCLUYE EL PAGO DE SEGUROS Y FIANZAS DE EQUIPO DE TRANSPORTE Y SEGUROS Y FIANZAS DE EDIFICIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 116),
(264, 415, 'SEGUROS Y FIANZAS DE AERONAVES', 'CANTIDADES DESTINADAS A CUBRIR EL IMPORTE DE PRIMAS DE SEGUROS Y FIANZAS DE AERONAVES QUE REQUIERAN LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO. SE EXCLUYE EL PAGO DE SEGUROS Y FIANZAS DE EQUIPO DE TRANSPORTE Y SEGUROS Y FIANZAS DE EDIFICIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 116),
(265, 343, 'ALMACENAJE, ENVASE Y EMBALAJE', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LOS SERVICIOS DE ALMACENAMIENTO, EMBALAJE, DESEMBALAJE, ENVASE Y DESENVASE DE TODA CLASE DE OBJETOS, ARTICULOS, MATERIALES, MOBILIARIO, ENTRE OTROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 117),
(266, 344, 'FLETES, ACARREOS Y ENVIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR TRASLADO Y MANIOBRAS DE EMBARQUE Y DESEMBARQUE DE TODA CLASE DE ARTICULOS, MATERIALES, ANIMALES, PLANTAS, MOBILIARIO, ENTRE OTROS,  QUE REQUIERAN LAS DEPENDENCIAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 118),
(267, 345, 'COMISIONES POR VENTAS', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE COMISIONES A PERSONAS FISICAS, YA SEAN: PROFESIONISTAS, TECNICO, EXPERTOS O PERITOS, ASI COMO A LAS PERSONAS MORALES, CON LAS CUALES SE TENGA CELEBRADO CONTRATO RESPECTIVO, POR LOS SERVICIOS DE VENTA PRESTADOS A LAS DEPENDENCIAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 119),
(268, 346, 'SERVICIOS FINANCIEROS, BANCARIOS Y COMERCIALES INTEGRALES', 'OTROS SERVICIOS FINANCIEROS, BANCARIOS Y COMERCIALES NO PREVISTOS EN LAS DEMAS PARTIDAS ANTERIORES DE ESTE CONCEPTO. INCLUYE CASETAS TELEFONICAS SIN OPERAR LAS REDES ALAMBRICAS, RECEPCION DE LLAMADAS TELEFONICAS Y PROMOCION POR TELEFONO DE BIENES Y SERVICIOS, DE RECEPCION DE LLAMADAS TELEFONICAS EN NOMBRE DE LOS CLIENTES. EXCLUYE: CALCULO DE IMPUESTOS Y PREPARACION DE FORMATOS PARA LA DECLARACION DE IMPUESTOS, AL PROCESAMIENTO DE DATOS, A LA OPERACION DE REDES DE TELEFONIA TRADICIONAL, VENTA DE PRODUCTOS POR TELEFONO, Y A LOS SERVICIOS DE CORREO ELECTRONICO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 120),
(269, 347, 'CONSERVACION Y MANTTO. MENOR DE INMUEBLES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE CONSERVACION Y MANTENIMIENTO MENOR DE EDIFICIOS, LOCALES, TERRENOS, PREDIOS, AREAS VERDES Y CAMINOS DE ACCESO, PROPIEDAD O AL SERVICIO DE LAS DEPENDENCIAS, CUANDO SE EFECTUEN POR CUENTA DE TERCEROS, INCLUIDO EL PAGO DE DEDUCIBLES DE SEGUROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 121),
(270, 348, 'INSTALACION, MANTTO. Y REPARACION DE MOBILIARIO Y EQUIPO DE ADMINISTRACION', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE INSTALACION, REPARACION Y MANTENIMIENTO DE TODA CLASE DE MOBILIARIO Y EQUIPO DE ADMINISTRACION, TALES COMO: ESCRITORIOS, SILLAS, SILLONES, ARCHIVEROS, MAQUINAS DE ESCRIBIR, CALCULADORAS, FOTOCOPIADORAS, DE EQUIPO DE COMUNICACIONES ENTRE OTROS. INCLUYE EL PAGO DE DEDUCIBLES DE SEGUROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 122),
(271, 349, 'INSTALACION, MANTTO. Y REPARACION DE BIENES ARTISTICOS Y CULTURALES', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR MANTENIMIENTO Y CONSERVACION DE  BIENES MUEBLES,  ARTISTICOS O CULTURALES COMO SON: PINTURAS, ESCULTURAS, CUADROS, COLECCIONES DIVERSAS, EDICIONES HISTORICAS, EQUIPOS MUSICALES PARA BANDAS Y ORQUESTAS, Y EN GENERAL TODOS LOS BIENES QUE CONSTITUYAN EL ACERVO PATRIMONIAL ARTISTICO Y CULTURAL, ASIGNADOS A LAS DEPENDENCIAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 122),
(272, 350, 'INSTALACION, MANTTO. Y REPARACION DE MOBILIARIO Y EQUIPO EDUCACIONAL Y RECREATIVO', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE INSTALACION, REPARACION Y MANTENIMIENTO DE TODA CLASE DE MOBILIARIO Y EQUIPO EDUCACIONAL Y RECREATIVO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 122),
(273, 351, 'INSTALACION, MANTENIMIENTO Y REPARACION DE EQUIPO  DE COMPUTO  Y TECNOLOGIA  DE LA INFORMACION', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS QUE SE CONTRATEN CON TERCEROS PARA LA INSTALACION, REPARACION Y MANTENIMIENTO DE EQUIPOS DE COMPUTO Y TECNOLOGIAS DE LA INFORMACION, TALES COMO: COMPUTADORAS, IMPRESORAS, DISPOSITIVOS DE SEGURIDAD, REGULADORES, FUENTES DE POTENCIA ININTERRUMPIDA, ENTRE OTROS. INCLUYE EL PAGO DE DEDUCIBLES DE SEGUROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 123),
(274, 352, 'INSTALACION, MANTTO Y REP. DE EQUIPO E INSTRUMENTAL MEDICO Y DE LABORATORIO', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE INSTALACION, REPARACION Y MANTENIMIENTO DE EQUIPO E INSTRUMENTAL MEDICO Y DE LABORATORIO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 124),
(275, 353, 'MANTTO. Y REPARACION DE EQUIPO DE TRANSPORTE', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE REPARACION Y MANTENIMIENTO DEL EQUIPO DE TRANSPORTE TERRESTRE, AEROESPACIAL, MARITIMO, LACUSTRE Y FLUVIAL, E INSTALACION DE EQUIPOS EN LOS MISMOS, PROPIEDAD O AL SERVICIO DEL GOBIERNO DEL ESTADO. INCLUYE EL PAGO DE DEDUCIBLES DE SEGUROS. (EXCLUYE CAUSAS IMPUTABLES A SERVIDORES PUBLICOS)', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 125),
(276, 354, 'MANTTO. Y REPARACION DE EQUIPO DE DEFENSA Y SEGURIDAD', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DEL SERVICIO DE MANO DE OBRA Y/O PIEZAS NECESARIAS PARA LA CONSERVACION DE ARMAMENTO EN GENERAL, ASIGNADO A LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 126),
(277, 355, 'INSTALACION, MANTTO. Y REPARACION DE MAQUINARIA, OTROS EQUIPOS Y HERRAMIENTA', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE INSTALACION, REPARACION Y MANTENIMIENTO DE LA MAQUINARIA, OTROS EQUIPOS Y HERRAMIENTA, PROPIEDAD O AL SERVICIO DE LOS ENTES PUBLICOS TALES COMO: TRACTORES, PALAS MECANICAS, DRAGAS, FERTILIZADORAS, VEHICULOS, EMBARCACIONES, AERONAVES, EQUIPO ESPECIALIZADO INSTALADO EN LOS INMUEBLES, ENTRE OTROS, CUANDO SE EFECTUEN POR CUENTA DE TERCEROS. INCLUYE EL MANTENIMIENTO DE PLANTAS E INSTALACIONES PRODUCTIVAS Y EL PAGO DE DEDUCIBLES DE SEGUROS. (EXCLUYE CAUSAS IMPUTABLES A SERVIDORES PUBLICOS)', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 127),
(278, 356, 'INSTALACION, MANTTO. Y REPARACION DE HERRAMIENTAS Y OTROS EQUIPOS (INHABILITADA)', 'ASIGNACIONES DESTINADAS A CUBRIR EL MANTENIMIENTO DE TODA CLASE DE HERRAMIENTAS PROPIEDAD O AL SERVICIO DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 127),
(279, 357, 'SERVICIOS DE LAVANDERIA, HIGIENE Y MANEJO DE DESECHOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR EL SERVICIO DE: LAVANDERIA, TINTORERIA, LIMPIEZA, DESINFECCION E HIGIENE DE LAS INSTALACIONES PERTENECIENTES A LAS DEPENDENCIAS QUE POR LA NATURALEZA DE SUS FUNCIONES LO REQUIERAN. INCLUYE SERVICIOS DE DRENAJE Y RECOLECCION DE BASURA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 128),
(280, 358, 'TRATAMIENTO DE RESIDUOS PELIGROSOS', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DEL SERVICIO POR  MANEJO Y TRATAMIENTO DE RESIDUOS PELIGROSOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 128),
(281, 359, 'SERVICIOS DE JARDINERIA Y FUMIGACION', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONTROL Y EXTERMINACION DE PLAGAS, INSTALACION Y MANTENIMIENTO DE AREAS VERDES COMO LA PLANTACION, FERTILIZACION Y PODA DE ARBOLES, PLANTAS Y HIERBAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 129),
(282, 361, 'DIFUSION SOBRE PROGRAMAS Y ACTIVIDADES GUBERNAMENTALES', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE DIFUSION DEL QUEHACER GUBERNAMENTAL A TRAVES DE LOS DIVERSOS MEDIOS MASIVOS DE COMUNICACION.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 130),
(283, 362, 'PUBLICACION Y DIVULGACION DE MENSAJES PARA PROMOCION DE BIENES O SERVICIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LA PUBLICIDAD DERIVADA DE LA COMERCIALIZACION DE LOS PRODUCTOS O SERVICIOS DE LOS ENTES PUBLICOS QUE GENERAN UN INGRESO PARA EL ESTADO. EXCLUYE LOS GASTOS DE DIFUSION DE MENSAJES QUE NO COMERCIALIZAN PRODUCTOS O SERVICIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 131),
(284, 363, 'IMPRESOS Y PUBLICACIONES OFICIALES', 'CANTIDADES DESTINADAS A CUBRIR EROGACIONES POR PROMOCION, DIFUSION Y PUBLICIDAD  A TRAVES DE LOS DIVERSOS MEDIOS DE COMUNICACION PARA DAR A CONOCER LOS SERVICIOS QUE PRESTAN LAS DEPENDENCIAS DEL GOBIERNO DEL ESTADO; ASI COMO LA  IMPRESION DE PAPELERIA OFICIAL, VALES DE COMBUSTIBLES, SELLOS OFICIALES, MEMBRETES, FORMATOS, INSTRUCTIVOS, TRIPTICOS, CARTELES, TRABAJOS SERIGRAFICOS Y ENCUADERNACION DE MEMORIAS DE EVENTOS, PARA LA IDENTIFICACION Y REALIZACION DE TRAMITES ADMINISTRATIVOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 132),
(285, 364, 'SERVICIOS DE CREATIVIDAD, PREPRODUCCION Y PRODUCCION DE PUBLICIDAD', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR DISEÑO Y CONCEPTUALIZACION DE CAMPAÑAS DE COMUNICACION, PREPRODUCCION, PRODUCCION Y COPIADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 132),
(286, 365, 'SERVICIOS DE REVELADO DE FOTOGRAFIAS', 'ASIGNACIONES DESTINADAS A CUBRIR GASTOS POR CONCEPTO DE REVELADO O IMPRESION DE FOTOGRAFIAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 133),
(287, 366, 'SERVICIOS DE LA INDUSTRIA FILMICA, DEL SONIDO Y DEL  VIDEO', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR POSTPRODUCCION (DOBLAJE, TITULAJE, SUBTITULAJE, EFECTOS VISUALES, ANIMACION, EDICION, CONVERSION DE FORMATO, COPIADO DE VIDEOS, ENTRE OTROS) Y A OTROS SERVICIOS PARA LA INDUSTRIA FILMICA Y DEL VIDEO COMO LA CRESTOMATIA Y LOS SERVICIOS PRESTADOS POR LOS LABORATORIOS FILMICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 134),
(288, 367, 'SERVICIOS DE CREACION Y DIFUSION POR INTERNET', 'ASIGNACIONES DESTINADAS A CUBRIR EL GASTO POR CREACION, DIFUSION Y TRANSMISION DE CONTENIDO DE INTERES GENERAL O ESPECIFICO A TRAVES DE INTERNET EXCLUSIVAMENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 135),
(289, 368, 'OTROS SERVICIOS DE INFORMACION', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LA CONTRATACION DE SERVICIOS PROFESIONALES CON PERSONAS FISICAS O MORALES, POR CONCEPTO DE MONITOREO DE INFORMACION EN MEDIOS MASIVOS DE COMUNICACION, DE LAS ACTIVIDADES DE LOS ENTES PUBLICOS, QUE NO SE ENCUENTREN COMPRENDIDAS EN LAS DEMAS PARTIDAS DE ESTE CAPITULO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 136),
(290, 369, 'PASAJES AEREOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONCEPTO DE TRASLADO DE PERSONAL POR VIA AEREA QUE SE UTILICEN EN EL CUMPLIMIENTO DE SUS FUNCIONES PUBLICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 137),
(291, 370, 'PASAJES TERRESTRES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONCEPTO DE TRASLADO DE PERSONAL POR VIA TERRESTRE URBANO Y SUBURBANO, INTERURBANO Y RURAL, TAXIS Y FERROVIARIO, EN CUMPLIMIENTO DE SUS FUNCIONES PUBLICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 138),
(292, 371, 'PASAJES MARITIMOS, LACUSTRES Y FLUVIALES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONCEPTO DE TRASLADO DE PERSONAL POR VIA MARITIMA, LACUSTRE Y FLUVIAL EN CUMPLIMIENTO DE SUS FUNCIONES PUBLICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 139),
(293, 372, 'AUTOTRANSPORTE', 'ASIGNACIONES DESTINADAS AL AUTOTRANSPORTE TANTO DE MERCANCIAS QUE NO REQUIEREN DE EQUIPO ESPECIALIZADO Y QUE NORMALMENTE SE TRANSPORTAN EN CAMIONES DE CAJA O EN CONTENEDORES, COMO DE AQUELLOS PRODUCTOS QUE POR SUS CARACTERISTICAS (LIQUIDOS, GASES, ETC.) REQUIEREN SER TRANSPORTADOS EN CAMIONES CON EQUIPO ESPECIALIZADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 140),
(294, 373, 'PASAJES Y PEAJE / PEAJES Y PUENTES', 'CANTIDADES DESTINADAS A CUBRIR GASTOS CON MOTIVO DEL USO O SERVICIO DE CARRETERAS Y PUENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 140),
(295, 374, 'VIATICOS EN EL PAIS', 'ASIGNACIONES DESTINADAS A CUBRIR AL PERSONAL DE LAS DEPENDENCIAS, EL COSTO DE ALIMENTACION, HOSPEDAJE Y ARRENDAMIENTO DE VEHICULOS QUE POR NECESIDAD DEL SERVICIO TENGAN QUE TRASLADARSE A LUGARES DISTINTOS A LOS DE SU ADSCRIPCION, PARA EL CUMPLIMIENTO DE COMISIONES OFICIALES APLICANDO  PARA TAL CASO LAS CUOTAS QUE SEÑALE EL TABULADOR VIGENTE. EXCLUYE LOS GASTOS DE PASAJES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 141),
(296, 375, 'VIATICOS EN EL EXTRANJERO', 'ASIGNACION SUJETA A COMPROBACION DE ACUERDO A LA NORMATIVIDAD EN LA MATERIA, PARA CUBRIR LA ALIMENTACION, HOSPEDAJE Y ARRENDAMIENTO DE VEHICULOS DE LOS SERVIDORES PUBLICOS QUE POR COMISIONES DEBAN ASISTIR AL EXTRANJERO PARA CUMPLIR CON FUNCIONES PROPIAS DE SU ACTIVIDAD, APLICANDO PARA TAL CASO LAS CUOTAS QUE SEÑALE EL TABULADOR VIGENTE. EXCLUYE LOS GASTOS DE PASAJES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 142),
(297, 376, 'GASTOS DE INSTALACION  Y TRASLADO DE MENAJE', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS QUE OCASIONE LA INSTALACION DEL PERSONAL AL SERVICIO DE LAS DEPENDENCIAS, CUANDO EN EL DESEMPEÑO DE FUNCIONES OFICIALES DENTRO O FUERA DEL PAIS, SE REQUIERA SU PERMANENCIA FUERA DE SU RESIDENCIA EN FORMA TRANSITORIA O PERMANENTE, INCLUYENDO, EN SU CASO, EL TRASLADO DE MENAJE DE CASA. EXCLUYE LOS PAGOS DE VIATICOS Y PASAJES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 143),
(298, 377, 'SERVICIOS INTEGRALES  DE TRASLADO  Y VIATICOS', 'ASIGNACIONES DESTINADAS A CUBRIR LAS EROGACIONES QUE REALICEN LAS DEPENDENCIAS POR LA CONTRATACION CON PERSONAS FISICAS Y MORALES DE SERVICIOS DIVERSOS CUYA DESAGREGACION NO ES REALIZABLE EN FORMA ESPECIFICA PARA CADA UNA DE LAS PARTIDAS DE GASTO DE ESTE CONCEPTO, POR TRATARSE DE UNA COMBINACION DE SERVICIOS RELACIONADOS CUYA PRESTACION SE ESTIPULA EN FORMA INTEGRAL Y QUE EN TERMINOS DEL COSTO TOTAL RESULTA EN CONDICIONES MENOS ONEROSAS PARA LAS DEPENDENCIAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 144),
(299, 378, 'GASTOS EN COMISION', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DE ALIMENTACION DEL PERSONAL QUE REALIZA TRABAJOS EXTRAORDINARIOS FUERA DEL HORARIO NORMAL DE LABORES, Y AQUELLOS QUE SE DERIVEN DE COMISIONES QUE NO AMERITE EL PAGO DE VIATICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 145),
(300, 379, 'OTROS SERVICIOS DE TRASLADO Y HOSPEDAJE', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE SERVICIOS BASICOS DISTINTOS DE LOS SEÑALADOS EN LAS PARTIDAS DE ESTE CONCEPTO, TALES COMO PENSIONES DE ESTACIONAMIENTO, ENTRE OTROS, REQUERIDOS EN EL DESEMPEÑO DE FUNCIONES OFICIALES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 145),
(301, 380, 'GASTOS CEREMONIALES, DE ORDEN SOCIAL Y FOMENTO DE ACTIVIDADES CIVICAS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS SERVICIOS INTEGRALES QUE SE CONTRATEN CON MOTIVO DE ORGANIZACION Y EJECUCION DE RECEPCIONES AL PERSONAL DEL CUERPO DIPLOMATICO ACREDITADO, AL C. PRESIDENTE DE LA REPUBLICA Y PERSONALIDADES NACIONALES O EXTRANJERAS RESIDENTES O DE VISITA EN EL TERRITORIO NACIONAL, ASI COMO PARA CUBRIR DICHOS GASTOS EN EVENTOS QUE SE REALICEN EN EL EXTRANJERO. INCLUYE BIENES Y SERVICIOS TALES COMO: ORGANIZACION Y EJECUCION DE RECEPCIONES, ADORNOS, ESCENOGRAFIA, ENTRE OTROS. ASIMISMO LOS GASTOS QUE SE ORIGINEN CON MOTIVO DE LA CELEBRACION DE ACTOS CONMEMORATIVOS Y DE ORDEN SOCIAL, TALES COMO LA REALIZACION DE CEREMONIAS PATRIOTICAS Y OFICIALES, DESFILES, ADQUISICION DE OFRENDAS FLORALES Y LUCTUOSAS, RENTA DE SILLAS, LONAS Y SONIDO, APOYOS EN DINERO O EN ESPECIE A INSTITUCIONES U ORGANISMO INDEPENDIENTES Y ENTIDADES DEL GOBIERNO DEL ESTADO, CUYAS ACTIVIDADES ESTEN DEDICADAS A FORTALECER Y SALVAGUARDAR LOS ACTOS CIVICOS, EN LOS QUE PARTICIPAN EL TITULAR DEL EJECUTIVO ESTATAL O MUNICIPAL, FUNCIONARIOS Y SERVIDORES PUBLICOS. NO PROCEDERA CARGAR A ESTA PARTIDA COMPRA O MANTENIMIENTO DE MOBILIARIO, EQUIPO O DEMAS ACTIVO FIJO, MATERIAL DE OFICINA Y EN GENERAL GASTOS DE OPERACION NORMAL DE LA DEPENDENCIA (GASTO CORRIENTE).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 146),
(302, 381, 'GASTOS DE ORDEN SOCIAL Y CULTURA', 'ASIGANACIONES DESTINADAS A CUBRIR LOS SERVICIOS INTEGRALES QUE SE CONTRATEN CON MOTIVO DE LA CELEBRACION DE ACTOS CONMEMORATIVOS, DE ORDEN SOCIAL Y CULTURAL; SIEMPRE Y CUANDO QUE POR TRATARSE DE SERVICIOS INTEGRALES NO PUEDAN DESAGREGARSE EN OTRAS PARTIDAS DE LOS CAPITULOS 2000 MATERIALES Y SUMINISTROS Y 3000 SERVICIOS GENERALES. INCLUYE LA REALIZACION DE CEREMONIAS PATRIOTICAS Y OFICIALES, DESFILES, LA AQUISICION DE OFRENDAS FLORALES Y LUCTUOSAS, CONCIERTOS, ENTRE OTROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 147),
(303, 382, 'REUNIONES, CONGRESOS Y CONVENCIONES', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE PREPARACION Y DESARROLLO DE CONGRESOS, ASAMBLEAS, REUNIONES DE TRABAJO Y CONVENCIONES; ACONDICIONAMIENTO DEL LOCAL; ALQUILER DE LOCAL Y EQUIPO; PAGO DE INDEMNIZACIONES POR DAÑOS QUE EVENTUALMENTE SUFRAN LOS BIENES UTILIZADOS EN LAS MISMAS, COSTO DE TRANSMISIONES POR RADIO Y TELEVISION, CUOTAS DE INSCRIPCION A CONGRESOS Y CONVENCIONES; INVITACIONES, ALIMENTACION, HOSPEDAJE Y TRANSPORTE DE LOS PARTICIPANTES; PROPAGANDA; HONORARIOS Y GRATIFICACIONES POR SERVICIOS PROFESIONALES INDEPENDIENTES DE MAESTROS DE CEREMONIAS, EDECANES Y TRADUCTORES; ENTRE OTROS. NO PROCEDERA CARGARSE A ESTA PARTIDA COMPRA O MANTENIMIENTO DE MOBILIARIO, EQUIPO O DEMAS ACTIVO FIJO, MATERIAL DE OFICINA Y EN GENERAL GASTOS DE OPERACION NORMAL DE LAS DEPENDENCIAS (GASTO CORRIENTE).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 148),
(304, 383, 'EXPOSICIONES Y ESPECTACULOS', 'CANTIDADES DESTINADAS A CUBRIR LOS GASTOS QUE SE GENEREN EN EL MONTAJE DE ESPECTACULOS Y EXPOSICIONES: ALQUILER DE LOCAL Y EQUIPO, SEGURO, INSTALACION, GASTOS DE ALIMENTACION Y HOSPEDAJE DE EXPOSITORES, INVITACIONES, PROPAGANDA, COSTO DE TRANSMISION POR RADIO Y TELEVISION, CUOTAS DE INSCRIPCION, EDECANES, ENTRE OTROS; PAGO DE INSUMOS Y SERVICIOS QUE SE REQUIERAN DIRECTAMENTE PARA LA REALIZACION DEL EVENTO, ADAPTACION Y DECORACIONES, ALOJAMIENTO DE ASISTENTES FORANEOS, COSTO DE ALIMENTOS, HONORARIOS A MAESTROS DE CEREMONIAS, ACTORES Y GRUPOS MUSICALES, ENTRE OTROS, QUE INCIDAN DIRECTAMENTE CON EL DESARROLLO DE DICHOS EVENTOS. INCLUYE EL PAGO DE INDEMNIZACIONES POR LOS DAÑOS QUE SUFRAN LOS BIENES EXPUESTOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 149),
(305, 385, 'GASTOS DE REPRESENTACION', 'ASIGNACIONES DESTINADAS A CUBRIR GASTOS AUTORIZADOS A LOS SERVIDORES PUBLICOS DE MANDOS MEDIOS Y SUPERIORES POR CONCEPTO DE ATENCION A ACTIVIDADES INSTITUCIONALES ORIGINADAS POR EL DESEMPEÑO DE LAS FUNCIONES ENCOMENDADAS PARA LA CONSECUCION DE LOS OBJETIVOS DE LAS DEPENDENCIAS A LAS QUE ESTEN ADSCRITOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 150),
(306, 386, 'PAGOS DE DEFUNCION', 'ASIGNACIONES DESTINADAS A CUBRIR SERVICIOS Y PAGOS DE DEFUNCION COMO TRASLADO DE CUERPOS, VELACION, APOYO PARA TRAMITES LEGALES, CREMACION Y EMBALSAMIENTO Y ATAUDES, A LOS FAMILIARES DE SERVIDORES PUBLICOS, CIVILES Y MILITARES AL SERVICIO DE LOS ENTES PUBLICOS, ASI COMO DE PENSIONISTAS DIRECTOS, CUYO PAGO ES CON CARGO AL ERARIO. INCLUYE LOS GASTOS POR CONCEPTO DE HONORES POSTUMOS A QUIENES POR SUS MERITOS O SERVICIOS SE CONSIDERE CONVENIENTE TRIBUTAR.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 151),
(307, 387, 'IMPUESTOS y DERECHOS', 'CANTIDADES DESTINADAS A CUBRIR IMPUESTOS O DERECHOS CON MOTIVO DEL USO O SERVICIO DE RADIOCOMUNICACIONES; LEGALIZACION DE EXHORTOS, DE REGISTRO PUBLICO DE LA PROPIEDAD, IMPUESTO PREDIAL Y TRASLADO DE DOMINIO;  ASI COMO DERECHOS POR LA PRESTACION DE SERVICIOS, SE INCLUYEN GASTOS AEROPORTUARIOS (ESPACIO AEREO, ATERRIZAJE , REGUARDO DE AERONAVES ASI COMO AQUELLOS GASTOS QUE SE GENEREN PARA EL TRAMITE DE DERECHOS QUE SE REALICEN A DIFERENTES INSTANCIAS POR EL USO DE LAS AERONAVES)', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 152),
(308, 388, 'IMPUESTOS Y DERECHOS VEHICULARES', 'CANTIDADES DESTINADAS A CUBRIR GASTOS POR CANJE DE PLACAS, REGISTRO DE CONTROL VEHICULAR, IMPUESTOS Y TENENCIA DE VEHICULOS DEL GOBIERNO DEL ESTADO, ENTRE OTROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 152),
(309, 416, 'SUSCRIPCIONES OFICIALES', 'CANTIDADES DESTINADAS A CUBRIR LAS SUSCRIPCIONES EN EL PERIODICO OFICIAL DEL ESTADO Y DIARIO OFICIAL DE LA FEDERACION POR LOS EJECUTORES DE GASTO EN EL DESEMPEÑO DE SUS FUNCIONES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 152),
(310, 389, 'IMPUESTOS Y  DERECHOS DE IMPORTACION', 'ASIGNACIONES DESTINADAS A CUBRIR LOS IMPUESTOS Y/O DERECHOS QUE CAUSE LA ADQUISICION DE TODA CLASE DE BIENES O SERVICIOS EN EL EXTRANJERO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 153),
(311, 390, 'SENTENCIAS Y RESOLUCIONES JUDICIALES', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE OBLIGACIONES O INDEMNIZACIONES DERIVADAS DE RESOLUCIONES EMITIDAS POR LA  AUTORIDAD COMPETENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 154),
(312, 391, 'PENAS, MULTAS, ACCESORIOS Y ACTUALIZACIONES', 'ASIGNACIONES DESTINADAS A CUBRIR LAS EROGACIONES DERIVADAS DEL PAGO EXTEMPORANEO DE PASIVOS FISCALES, ADEUDOS U OBLIGACIONES DE PAGO, COMO MULTAS, ACTUALIZACIONES, INTERESES Y DEMAS ACCESORIOS POR DICHOS PAGOS. INCLUYE LOS GASTOS FINANCIEROS POR PAGO EXTEMPORANEO DE ESTIMACIONES Y DE AJUSTE DE COSTOS DE OBRA PUBLICA, ASI COMO LOS GASTOS NO RECUPERABLES DERIVADOS DE LA TERMINACION ANTICIPADA DE CONTRATOS DE ADQUISICIONES U OBRAS PUBLICAS. EXCLUYE CAUSAS IMPUTABLES A SERVIDORES PUBLICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 155),
(313, 392, 'PERDIDAS AL ERARIO Y OTROS GASTOS POR RESPONSABILIDAD', 'EROGACIONES DE LAS DEPENDENCIAS QUE SE DERIVEN DEL ROBO O EXTRAVIO, ENTRE OTROS, DE RECURSOS PUBLICOS QUE NO SEAN RECUPERABLES E IMPLIQUEN AFECTAR SU TECHO PRESUPUESTARIO DISPONIBLE. EXCLUYE LAS RECUPERACIONES DE RECURSOS QUE SE REALICEN POR LOS DIVERSOS MEDIOS ESTABLECIDOS POR LAS DISPOSICIONES APLICABLES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 156),
