(332, 4, 'SUELDOS PARA BASE', 'IMPORTE DESTINADO A CUBRIR REMUNERACIONES POR CONCEPTO DE SUELDO BASE Y DIAS DE AJUSTE ANUAL, AL PERSONAL DE LAS ENTIDADES DEL GOBIERNO DEL ESTADO QUE CUENTE CON NOMBRAMIENTO DE BASE,  CONFORME AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
