(337, 12, 'RETROACTIVO DE SUELDOS APC PARA CONFIANZA', 'CANTIDAD DESTINADA A CUBRIR EL SUELDO RETROACTIVO AL PERSONAL DE CONFIANZA DE LAS ENTIDADES DEL GOBIERNO DEL ESTADO, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(338, 13, 'SUELDOS A PERSONAL ADSCRITO EN EL EXTRANJERO', 'ASIGNACIONES DESTINADAS A CUBRIR LAS REMUNERACIONES DEL PERSONAL QUE LABORA EN REPRESENTACIONES ESTATALES EN EL EXTRANJERO. INCLUYE LAS VARIACIONES DEL FACTOR DE AJUSTE: IMPORTANCIA RELATIVA DE LA OFICINA DE ADSCRIPCION; COSTO DE LA VIDA EN EL LUGAR DE ADSCRIPCION Y CONDICIONES DE DIFICULTAD DE LA VIDA EN CADA ADSCRIPCION. DICHAS REMUNERACIONES SON CUBIERTAS EXCLUSIVAMENTE AL PERSONAL QUE LABORE EN ESAS REPRESENTACIONES EN EL EXTERIOR.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(339, 14, 'HONORARIOS ASIMILABLES A SALARIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO POR LA PRESTACION DE SERVICIOS CONTRATADOS POR LAS ENTIDADES CON PERSONAS FISICAS, COMO PROFESIONISTAS, TECNICOS, EXPERTOS Y PERITOS, ENTRE OTROS, POR ESTUDIOS, OBRAS O TRABAJOS DETERMINADOS QUE CORRESPONDAN A SU ESPECIALIDAD. EL PAGO DE HONORARIOS DEBERA SUJETARSE A LAS DISPOSICIONES APLICABLES. ESTA PARTIDA EXCLUYE LOS SERVICIOS PROFESIONALES CONTRATADOS CON PERSONAS FISICAS O MORALES PREVISTOS EN EL CAPITULO 3000 SERVICIOS GENERALES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(340, 15, 'SUELDOS PARA CONTRATO', 'IMPORTE QUE SE DESTINA PARA CUBRIR REMUNERACIONES POR CONCEPTO DE SUELDO Y DIAS DE AJUSTE AL PERSONAL QUE ESTA SUJETO A UN CONTRATO INDIVIDUAL DE TRABAJO POR TIEMPO DETERMINADO CON LAS ENTIDADES DEL GOBIERNO DEL ESTADO, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(341, 16, 'RETROACTIVO DE SUELDOS APC PARA CONTRATO', 'CANTIDAD DESTINADA A CUBRIR EL SUELDO RETROACTIVO AL PERSONAL DE CONTRATO DE LAS ENTIDADES DEL GOBIERNO DEL ESTADO, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
