(617, 362, 'PUBLICACION Y DIVULGACION DE MENSAJES PARA PROMOCION DE BIENES O SERVICIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LA PUBLICIDAD DERIVADA DE LA COMERCIALIZACION DE LOS PRODUCTOS O SERVICIOS DE LOS ENTES PUBLICOS QUE GENERAN UN INGRESO PARA EL ESTADO. EXCLUYE LOS GASTOS DE DIFUSION DE MENSAJES QUE NO COMERCIALIZAN PRODUCTOS O SERVICIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(618, 363, 'IMPRESOS Y PUBLICACIONES OFICIALES', 'CANTIDADES DESTINADAS A CUBRIR EROGACIONES POR PROMOCION, DIFUSION Y PUBLICIDAD  A TRAVES DE LOS DIVERSOS MEDIOS DE COMUNICACION PARA DAR A CONOCER LOS SERVICIOS QUE PRESTAN LAS ENTIDADES DEL GOBIERNO DEL ESTADO; ASI COMO LA  IMPRESION DE PAPELERIA OFICIAL, VALES DE COMBUSTIBLES, SELLOS OFICIALES, MEMBRETES, FORMATOS, INSTRUCTIVOS, TRIPTICOS, CARTELES, TRABAJOS SERIGRAFICOS Y ENCUADERNACION DE MEMORIAS DE EVENTOS, PARA LA IDENTIFICACION Y REALIZACION DE TRAMITES ADMINISTRATIVOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(619, 364, 'SERVICIOS DE CREATIVIDAD, PREPRODUCCION Y PRODUCCION DE PUBLICIDAD', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR DISEÑO Y CONCEPTUALIZACION DE CAMPAÑAS DE COMUNICACION, PREPRODUCCION, PRODUCCION Y COPIADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(620, 365, 'SERVICIOS DE REVELADO DE FOTOGRAFIAS', 'ASIGNACIONES DESTINADAS A CUBRIR GASTOS POR CONCEPTO DE REVELADO O IMPRESION DE FOTOGRAFIAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(621, 366, 'SERVICIOS DE LA INDUSTRIA FILMICA, DEL SONIDO Y DEL  VIDEO', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR POSTPRODUCCION (DOBLAJE, TITULAJE, SUBTITULAJE, EFECTOS VISUALES, ANIMACION, EDICION, CONVERSION DE FORMATO, COPIADO DE VIDEOS, ENTRE OTROS) Y A OTROS SERVICIOS PARA LA INDUSTRIA FILMICA Y DEL VIDEO COMO LA CRESTOMATIA Y LOS SERVICIOS PRESTADOS POR LOS LABORATORIOS FILMICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(622, 367, 'SERVICIOS DE CREACION Y DIFUSION POR INTERNET', 'ASIGNACIONES DESTINADAS A CUBRIR EL GASTO POR CREACION, DIFUSION Y TRANSMISION DE CONTENIDO DE INTERES GENERAL O ESPECIFICO A TRAVES DE INTERNET EXCLUSIVAMENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(623, 368, 'OTROS SERVICIOS DE INFORMACION', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LA CONTRATACION DE SERVICIOS PROFESIONALES CON PERSONAS FISICAS O MORALES, POR CONCEPTO DE MONITOREO DE INFORMACION EN MEDIOS MASIVOS DE COMUNICACION, DE LAS ACTIVIDADES DE LOS ENTES PUBLICOS, QUE NO SE ENCUENTREN COMPRENDIDAS EN LAS DEMAS PARTIDAS DE ESTE CAPITULO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(624, 369, 'PASAJES AEREOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONCEPTO DE TRASLADO DE PERSONAL POR VIA AEREA QUE SE UTILICEN EN EL CUMPLIMIENTO DE SUS FUNCIONES PUBLICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(625, 370, 'PASAJES TERRESTRES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONCEPTO DE TRASLADO DE PERSONAL POR VIA TERRESTRE URBANO Y SUBURBANO, INTERURBANO Y RURAL, TAXIS Y FERROVIARIO, EN CUMPLIMIENTO DE SUS FUNCIONES PUBLICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(626, 371, 'PASAJES MARITIMOS, LACUSTRES Y FLUVIALES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONCEPTO DE TRASLADO DE PERSONAL POR VIA MARITIMA, LACUSTRE Y FLUVIAL EN CUMPLIMIENTO DE SUS FUNCIONES PUBLICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(627, 372, 'AUTOTRANSPORTE', 'ASIGNACIONES DESTINADAS AL AUTOTRANSPORTE TANTO DE MERCANCIAS QUE NO REQUIEREN DE EQUIPO ESPECIALIZADO Y QUE NORMALMENTE SE TRANSPORTAN EN CAMIONES DE CAJA O EN CONTENEDORES, COMO DE AQUELLOS PRODUCTOS QUE POR SUS CARACTERISTICAS (LIQUIDOS, GASES, ETC.) REQUIEREN SER TRANSPORTADOS EN CAMIONES CON EQUIPO ESPECIALIZADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(628, 373, 'PEAJES Y PUENTES', 'CANTIDADES DESTINADAS A CUBRIR GASTOS CON MOTIVO DEL USO O SERVICIO DE CARRETERAS Y PUENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(629, 374, 'VIATICOS EN EL PAIS', 'ASIGNACIONES DESTINADAS A CUBRIR AL PERSONAL DE LAS ENTIDADES, EL COSTO DE ALIMENTACION, HOSPEDAJE Y ARRENDAMIENTO DE VEHICULOS QUE POR NECESIDAD DEL SERVICIO TENGAN QUE TRASLADARSE A LUGARES DISTINTOS A LOS DE SU ADSCRIPCION, PARA EL CUMPLIMIENTO DE COMISIONES OFICIALES APLICANDO  PARA TAL CASO LAS CUOTAS QUE SEÑALE EL TABULADOR VIGENTE. EXCLUYE LOS GASTOS DE PASAJES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(630, 375, 'VIATICOS EN EL EXTRANJERO', 'ASIGNACION SUJETA A COMPROBACION DE ACUERDO A LA NORMATIVIDAD EN LA MATERIA, PARA CUBRIR LA ALIMENTACION, HOSPEDAJE Y ARRENDAMIENTO DE VEHICULOS DE LOS SERVIDORES PUBLICOS QUE POR COMISIONES DEBAN ASISTIR AL EXTRANJERO PARA CUMPLIR CON FUNCIONES PROPIAS DE SU ACTIVIDAD, APLICANDO PARA TAL CASO LAS CUOTAS QUE SEÑALE EL TABULADOR VIGENTE. EXCLUYE LOS GASTOS DE PASAJES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(631, 376, 'GASTOS DE INSTALACION  Y TRASLADO DE MENAJE', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS QUE OCASIONE LA INSTALACION DEL PERSONAL AL SERVICIO DE LAS ENTIDADES, CUANDO EN EL DESEMPEÑO DE FUNCIONES OFICIALES DENTRO O FUERA DEL PAIS, SE REQUIERA SU PERMANENCIA FUERA DE SU RESIDENCIA EN FORMA TRANSITORIA O PERMANENTE, INCLUYENDO, EN SU CASO, EL TRASLADO DE MENAJE DE CASA. EXCLUYE LOS PAGOS DE VIATICOS Y PASAJES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(632, 377, 'SERVICIOS INTEGRALES  DE TRASLADO  Y VIATICOS', 'ASIGNACIONES DESTINADAS A CUBRIR LAS EROGACIONES QUE REALICEN LAS ENTIDADES POR LA CONTRATACION CON PERSONAS FISICAS Y MORALES DE SERVICIOS DIVERSOS CUYA DESAGREGACION NO ES REALIZABLE EN FORMA ESPECIFICA PARA CADA UNA DE LAS PARTIDAS DE GASTO DE ESTE CONCEPTO, POR TRATARSE DE UNA COMBINACION DE SERVICIOS RELACIONADOS CUYA PRESTACION SE ESTIPULA EN FORMA INTEGRAL Y QUE EN TERMINOS DEL COSTO TOTAL RESULTA EN CONDICIONES MENOS ONEROSAS PARA LAS ENTIDADES', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(633, 378, 'GASTOS EN COMISION', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DE ALIMENTACION DEL PERSONAL QUE REALIZA TRABAJOS EXTRAORDINARIOS FUERA DEL HORARIO NORMAL DE LABORES, Y AQUELLOS QUE SE DERIVEN DE COMISIONES QUE NO AMERITE EL PAGO DE VIATICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(634, 379, 'OTROS SERVICIOS DE TRASLADO Y HOSPEDAJE', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE SERVICIOS BASICOS DISTINTOS DE LOS SEÑALADOS EN LAS PARTIDAS DE ESTE CONCEPTO, TALES COMO PENSIONES DE ESTACIONAMIENTO, ENTRE OTROS, REQUERIDOS EN EL DESEMPEÑO DE FUNCIONES OFICIALES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(635, 380, 'GASTOS CEREMONIALES, DE ORDEN SOCIAL Y FOMENTO DE ACTIVIDADES CIVICAS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS SERVICIOS INTEGRALES QUE SE CONTRATEN CON MOTIVO DE ORGANIZACION Y EJECUCION DE RECEPCIONES AL PERSONAL DEL CUERPO DIPLOMATICO ACREDITADO, AL C. PRESIDENTE DE LA REPUBLICA Y PERSONALIDADES NACIONALES O EXTRANJERAS RESIDENTES O DE VISITA EN EL TERRITORIO NACIONAL, ASI COMO PARA CUBRIR DICHOS GASTOS EN EVENTOS QUE SE REALICEN EN EL EXTRANJERO. INCLUYE BIENES Y SERVICIOS TALES COMO: ORGANIZACION Y EJECUCION DE RECEPCIONES, ADORNOS, ESCENOGRAFIA, ENTRE OTROS. ASIMISMO LOS GASTOS QUE SE ORIGINEN CON MOTIVO DE LA CELEBRACION DE ACTOS CONMEMORATIVOS Y DE ORDEN SOCIAL, TALES COMO LA REALIZACION DE CEREMONIAS PATRIOTICAS Y OFICIALES, DESFILES, ADQUISICION DE OFRENDAS FLORALES Y LUCTUOSAS, RENTA DE SILLAS, LONAS Y SONIDO, APOYOS EN DINERO O EN ESPECIE A INSTITUCIONES U ORGANISMO INDEPENDIENTES Y ENTIDADES DEL GOBIERNO DEL ESTADO, CUYAS ACTIVIDADES ESTEN DEDICADAS A FORTALECER Y SALVAGUARDAR LOS ACTOS CIVICOS, EN LOS QUE PARTICIPAN EL TITULAR DEL EJECUTIVO ESTATAL O MUNICIPAL, FUNCIONARIOS Y SERVIDORES PUBLICOS. NO PROCEDERA CARGAR A ESTA PARTIDA COMPRA O MANTENIMIENTO DE MOBILIARIO, EQUIPO O DEMAS ACTIVO FIJO, MATERIAL DE OFICINA Y EN GENERAL GASTOS DE OPERACION NORMAL DE LA ENTIDAD (GASTO CORRIENTE).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(636, 382, 'REUNIONES, CONGRESOS Y CONVENCIONES', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE PREPARACION Y DESARROLLO DE CONGRESOS, ASAMBLEAS, REUNIONES DE TRABAJO Y CONVENCIONES; ACONDICIONAMIENTO DEL LOCAL; ALQUILER DE LOCAL Y EQUIPO; PAGO DE INDEMNIZACIONES POR DAÑOS QUE EVENTUALMENTE SUFRAN LOS BIENES UTILIZADOS EN LAS MISMAS, COSTO DE TRANSMISIONES POR RADIO Y TELEVISION, CUOTAS DE INSCRIPCION A CONGRESOS Y CONVENCIONES; INVITACIONES, ALIMENTACION, HOSPEDAJE Y TRANSPORTE DE LOS PARTICIPANTES; PROPAGANDA; HONORARIOS Y GRATIFICACIONES POR SERVICIOS PROFESIONALES INDEPENDIENTES DE MAESTROS DE CEREMONIAS, EDECANES Y TRADUCTORES; ENTRE OTROS. NO PROCEDERA CARGARSE A ESTA PARTIDA COMPRA O MANTENIMIENTO DE MOBILIARIO, EQUIPO O DEMAS ACTIVO FIJO, MATERIAL DE OFICINA Y EN GENERAL GASTOS DE OPERACION NORMAL DE LAS ENTIDADES (GASTO CORRIENTE).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(637, 383, 'EXPOSICIONES Y ESPECTACULOS', 'CANTIDADES DESTINADAS A CUBRIR LOS GASTOS QUE SE GENEREN EN EL MONTAJE DE ESPECTACULOS Y EXPOSICIONES: ALQUILER DE LOCAL Y EQUIPO, SEGURO, INSTALACION, GASTOS DE ALIMENTACION Y HOSPEDAJE DE EXPOSITORES, INVITACIONES, PROPAGANDA, COSTO DE TRANSMISION POR RADIO Y TELEVISION, CUOTAS DE INSCRIPCION, EDECANES, ENTRE OTROS; PAGO DE INSUMOS Y SERVICIOS QUE SE REQUIERAN DIRECTAMENTE PARA LA REALIZACION DEL EVENTO, ADAPTACION Y DECORACIONES, ALOJAMIENTO DE ASISTENTES FORANEOS, COSTO DE ALIMENTOS, HONORARIOS A MAESTROS DE CEREMONIAS, ACTORES Y GRUPOS MUSICALES, ENTRE OTROS, QUE INCIDAN DIRECTAMENTE CON EL DESARROLLO DE DICHOS EVENTOS. INCLUYE EL PAGO DE INDEMNIZACIONES POR LOS DAÑOS QUE SUFRAN LOS BIENES EXPUESTOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(638, 385, 'GASTOS DE REPRESENTACION', 'ASIGNACIONES DESTINADAS A CUBRIR GASTOS AUTORIZADOS A LOS SERVIDORES PUBLICOS DE MANDOS MEDIOS Y SUPERIORES POR CONCEPTO DE ATENCION A ACTIVIDADES INSTITUCIONALES ORIGINADAS POR EL DESEMPEÑO DE LAS FUNCIONES ENCOMENDADAS PARA LA CONSECUCION DE LOS OBJETIVOS DE LAS ENTIDADES A LAS QUE ESTEN ADSCRITOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(639, 386, 'PAGOS DE DEFUNCION', 'ASIGNACIONES DESTINADAS A CUBRIR SERVICIOS Y PAGOS DE DEFUNCION COMO TRASLADO DE CUERPOS, VELACION, APOYO PARA TRAMITES LEGALES, CREMACION Y EMBALSAMIENTO Y ATAUDES, A LOS FAMILIARES DE SERVIDORES PUBLICOS, CIVILES Y MILITARES AL SERVICIO DE LAS ENTIDADES, ASI COMO DE PENSIONISTAS DIRECTOS, CUYO PAGO ES CON CARGO AL ERARIO. INCLUYE LOS GASTOS POR CONCEPTO DE HONORES POSTUMOS A QUIENES POR SUS MERITOS O SERVICIOS SE CONSIDERE CONVENIENTE TRIBUTAR.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(640, 387, 'IMPUESTOS y DERECHOS', 'CANTIDADES DESTINADAS A CUBRIR IMPUESTOS O DERECHOS CON MOTIVO DEL USO O SERVICIO DE RADIOCOMUNICACIONES; LEGALIZACION DE EXHORTOS, DE REGISTRO PUBLICO DE LA PROPIEDAD, IMPUESTO PREDIAL Y TRASLADO DE DOMINIO;  ASI COMO DERECHOS POR LA PRESTACION DE SERVICIOS, SE INCLUYEN GASTOS AEROPORTUARIOS (ESPACIO AEREO, ATERRIZAJE , REGUARDO DE AERONAVES ASI COMO AQUELLOS GASTOS QUE SE GENEREN PARA EL TRAMITE DE DERECHOS QUE SE REALICEN A DIFERENTES INSTANCIAS POR EL USO DE LAS AERONAVES)', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(641, 388, 'IMPUESTOS Y DERECHOS VEHICULARES', 'CANTIDADES DESTINADAS A CUBRIR GASTOS POR CANJE DE PLACAS,  REGISTRO DE CONTROL  VEHICULAR, IMPUESTOS Y TENENCIA DE VEHICULOS DEL GOBIERNO DEL ESTADO, ENTRE OTROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160);
