(642, 389, 'IMPUESTOS Y  DERECHOS DE IMPORTACION', 'ASIGNACIONES DESTINADAS A CUBRIR LOS IMPUESTOS Y/O DERECHOS QUE CAUSE LA ADQUISICION DE TODA CLASE DE BIENES O SERVICIOS EN EL EXTRANJERO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(643, 390, 'SENTENCIAS Y RESOLUCIONES JUDICIALES', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE OBLIGACIONES O INDEMNIZACIONES DERIVADAS DE RESOLUCIONES EMITIDAS POR LA  AUTORIDAD COMPETENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(644, 391, 'PENAS, MULTAS, ACCESORIOS Y ACTUALIZACIONES', 'ASIGNACIONES DESTINADAS A CUBRIR LAS EROGACIONES DERIVADAS DEL PAGO EXTEMPORANEO DE PASIVOS FISCALES, ADEUDOS U OBLIGACIONES DE PAGO, COMO MULTAS, ACTUALIZACIONES, INTERESES Y DEMAS ACCESORIOS POR DICHOS PAGOS. INCLUYE LOS GASTOS FINANCIEROS POR PAGO EXTEMPORANEO DE ESTIMACIONES Y DE AJUSTE DE COSTOS DE OBRA PUBLICA, ASI COMO LOS GASTOS NO RECUPERABLES DERIVADOS DE LA TERMINACION ANTICIPADA DE CONTRATOS DE ADQUISICIONES U OBRAS PUBLICAS. EXCLUYE CAUSAS IMPUTABLES A SERVIDORES PUBLICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(645, 392, 'PERDIDAS AL ERARIO Y OTROS GASTOS POR RESPONSABILIDAD', 'EROGACIONES DE LAS DEPENDENCIAS QUE SE DERIVEN DEL ROBO O EXTRAVIO, ENTRE OTROS, DE RECURSOS PUBLICOS QUE NO SEAN RECUPERABLES E IMPLIQUEN AFECTAR SU TECHO PRESUPUESTARIO DISPONIBLE. EXCLUYE LAS RECUPERACIONES DE RECURSOS QUE SE REALICEN POR LOS DIVERSOS MEDIOS ESTABLECIDOS POR LAS DISPOSICIONES APLICABLES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(646, 393, 'UTILIDADES', 'ASIGNACIONES DESTINADAS POR LAS EMPRESAS DE PARTICIPACION ESTATAL AL PAGO DE UTILIDADES, EN LOS TERMINOS DE LAS DISPOSICIONES APLICABLES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(647, 394, 'IMPUESTO SOBRE NOMINAS BASE', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LAS ENTIDADES DEL GOBIERNO DEL ESTADO DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE BASE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(648, 395, 'IMPUESTO SOBRE NOMINAS MMyS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LAS ENTIDADES DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE MANDOS MEDIOS Y SUPERIORES DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(649, 396, 'IMPUESTO SOBRE NOMINAS CONTRATO', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LAS ENTIDADES DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE CONTRATO DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(650, 397, 'IMPUESTO SOBRE NOMINAS CONFIANZA', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LAS ENTIDADES DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE CONFIANZA DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(651, 398, 'IMPUESTO SOBRE NOMINAS CONTRATO CONFIANZA', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LAS ENTIDADES DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE CONTRATO CONFIANZA DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(652, 400, 'OTROS IMPUESTOS DERIVADOS DE RELACION LABORAL BASE', 'ASIGNACIONES DESTINADAS AL PAGO DE OTROS IMPUESTOS NO INCLUIDOS EN OTRAS PARTIDAS DERIVADOS DE LA RELACION LABORAL CON PERSONAL DE BASE DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(653, 401, 'OTROS IMPUESTOS DERIVADOS DE RELACION LABORAL MMyS', 'ASIGNACIONES DESTINADAS AL PAGO DE OTROS IMPUESTOS NO INCLUIDOS DERIVADOS DE LA RELACION LABORAL CON PERSONAL DE MANDOS MEDIOS Y SUPERIORES DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(654, 402, 'OTROS IMPUESTOS DERIVADOS DE RELACION LABORAL CONTRATO', 'ASIGNACIONES DESTINADAS AL PAGO DE OTROS IMPUESTOS NO INCLUIDOS DERIVADOS DE LA RELACION LABORAL CON PERSONAL DE CONTRATO DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(655, 403, 'OTROS IMPUESTOS DERIVADOS DE RELACION LABORAL CONFIANZA', 'ASIGNACIONES DESTINADAS AL PAGO DE OTROS IMPUESTOS NO INCLUIDOS DERIVADOS DE LA RELACION LABORAL CON PERSONAL DE CONFIANZA DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(656, 404, 'OTROS IMPUESTOS DERIVADOS DE RELACION LABORAL CONTRATO CONFIANZA', 'ASIGNACIONES DESTINADAS AL PAGO DE OTROS IMPUESTOS NO INCLUIDOS DERIVADOS DE LA RELACION LABORAL CON PERSONAL DE CONTRATO CONFIANZA DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(657, 407, 'SERVICIOS PARA PROYECTOS PPS (INHABILITADA)', 'CANTIDADES DESTINADAS AL CUMPLIMIENTO DE OBLIGACIONES QUE ASUMIO EL ESTADO CON MOTIVO DE LA SUSCRIPCION DEL CONTRATO DE PRESTACION DE SERVICIOS DE LARGO PLAZO, PARA LA CREACION DE INFRAESTRUCTURA, EQUIPAMIENTO Y MANTENIMIENTO DE LAS CIUDADES ADMINISTRATIVA Y JUDICIAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(658, 408, 'OTROS SERVICIOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS SERVICIOS QUE CORRESPONDAN A ESTE CAPITULO, NO PREVISTOS EXPRESAMENTE EN LAS PARTIDAS ANTES DESCRITAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(659, 410, 'COMBURENTES DIVERSOS', 'ASIGNACIONES DESTINADAS AL SUMINISTRO DE COMBURENTES DIVERSOS, TALES COMO: PETROLEO, LEÑA, ETC., REQUERIDOS PARA EL DESEMPEÑO DE FUNCIONES OFICIALES DE LAS DEPENDENCIAS DE GOBIERNO Y QUE NO ESTEN CONSIDERADOS EN OTRAS CLASIFICACIONES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(660, 411, 'IMPUESTO SOBRE NOMINAS HONORARIOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LAS DEPENDENCIAS DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE HONORARIOS DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
(661, 412, 'SERVICIOS INTEGRALES PARA ATENCIONES MEDICAS', 'COMPRENDE LAS EROGACIONES REALIZADAS POR UNIDADES MEDICAS POR LOS SERVICIOS PRESTADOS A LOS BENEFICIARIOS DEL SEGURO POPULAR, CORRESPONDIENTE AL 20% DE LAS ATENCIONES MEDICAS', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 160),
