(888, 332, 'COMISIONES Y SITUACIONES BANCARIAS', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DE TRASLADO, CUSTODIA DE VALORES Y SERVICIOS BANCARIOS NECESARIOS PARA EL MOVIMIENTO DE FONDOS. (SE EXCEPTUA EL PAGO DE COMISIONES POR SOBREGIRO).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(889, 333, 'COMISIONES Y GASTOS FINANCIEROS', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO FINANCIERO POR CONTRATACION DE CREDITOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(890, 334, 'SERVICIOS DE COBRANZA', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE COBRANZA, QUE REQUIERA EL PODER LEGISLATIVO CON MOTIVO DE LAS FUNCIONES QUE REALIZA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(891, 335, 'SERVICIOS DE INVESTIGACION CREDITICIA Y SIMILARES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR INVESTIGACION CREDITICIA Y RECOPILACION DE INFORMACION SOBRE SOLVENCIA FINANCIERA DE PERSONAS O NEGOCIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(892, 336, 'SERVICIOS DE RECAUDACION, TRASLADO Y CUSTODIA DE VALORES', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE SERVICIOS FINANCIEROS POR GUARDA, CUSTODIA, TRASLADO DE VALORES Y OTROS GASTOS INHERENTES A LA RECAUDACION.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(893, 337, 'SEGUROS DE RESPONSABILIDAD PATRIMONIAL', 'ASIGNACIONES DESTINADAS A CUBRIR LAS PRIMAS CON CARGO AL PRESUPUESTO AUTORIZADO DE LOS ENTES PUBLICOS, POR CONCEPTO DE LA CONTRATACION DEL SEGURO DE RESPONSABILIDAD PATRIMONIAL DEL ESTADO, QUE PERMITA CON LA SUMA ASEGURADA CUBRIR EL MONTO EQUIVALENTE A LAS INDEMNIZACIONES Y QUE CORRESPONDERAN A LA REPARACION INTEGRAL DEL DAÑO Y, EN SU CASO, POR EL DAÑO PERSONAL Y MORAL, QUE SE OCASIONEN COMO CONSECUENCIA DE LA ACTIVIDAD ADMINISTRATIVA IRREGULAR DEL ESTADO. EXCLUYE EL MONTO DE LAS EROGACIONES QUE RESULTEN POR INSUFICIENCIA DE LA SUMA ASEGURADA CONTRA EL COSTO DE LA INDEMNIZACION Y, EN SU CASO, LOS DEDUCIBLES CORRESPONDIENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(894, 338, 'SEGUROS POR CREDITOS', 'ASIGNACIONES DESTINADAS A CUBRIR  EL IMPORTE DE PRIMAS POR SEGUROS CONTRATADOS PARA GARANTIZAR EL PAGO SOBRE PRESTAMOS QUIROGRAFARIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(895, 339, 'FIANZAS PARA PRELIBERACION', 'DEPOSITOS AL FONDO DE PROCURACION DE JUSTICIA, QUE SE DERIVAN DE GARANTIAS O AFIANZAMIENTO DE INDICIADOS EN PROCESOS JUDICIALES PARA LA REPARACION DEL DAÑO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(896, 340, 'SEGUROS Y FIANZAS DE EQUIPO DE TRANSPORTE', 'ASIGNACIONES DESTINADAS A CUBRIR EL IMPORTE DE PRIMAS POR SEGUROS Y FIANZAS, CONTRATADOS A TERCEROS A FIN DE RESGUARDAR  CONTRA ROBOS, INCENDIOS Y  DEMAS RIESGOS O CONTINGENCIAS A QUE PUEDA ESTAR SUJETO EL EQUIPO DE TRANSPORTE REGISTRADO EN LOS ACTIVOS A CARGO DE LAS ENTIDADES. SE EXCLUYE EL MONTO DE LOS DEDUCIBLES CORRESPONDIENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(897, 341, 'SEGUROS Y FIANZAS DE EDIFICIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL IMPORTE DE PRIMAS POR SEGUROS Y FIANZAS, CONTRATADOS A TERCEROS A FIN DE RESGUARDAR EL PATRIMONIO INMOBILIARIO A CARGO DEL PODER LEGISLATIVO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(898, 342, 'PRIMAS DE SEGUROS Y FIANZAS', 'CANTIDADES  DESTINADAS A CUBRIR EL IMPORTE DE PRIMAS DE SEGUROS Y FIANZAS DE EQUIPO DE COMPUTO, BIENES ARTISTICOS, ENTRE OTROS QUE REQUIERAN EL PODER LEGISLATIVO. SE EXCLUYE EL PAGO DE SEGUROS Y FIANZAS DE EQUIPO DE TRANSPORTE Y SEGUROS Y FIANZAS DE EDIFICIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(899, 343, 'ALMACENAJE, ENVASE Y EMBALAJE', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LOS SERVICIOS DE ALMACENAMIENTO, EMBALAJE, DESEMBALAJE, ENVASE Y DESENVASE DE TODA CLASE DE OBJETOS, ARTICULOS, MATERIALES, MOBILIARIO, ENTRE OTROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(900, 344, 'FLETES, ACARREOS Y ENVIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR TRASLADO Y MANIOBRAS DE EMBARQUE Y DESEMBARQUE DE TODA CLASE DE ARTICULOS, MATERIALES, ANIMALES, PLANTAS, MOBILIARIO, ENTRE OTROS,  QUE REQUIERA EL PODER LEGISLATIVO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(901, 345, 'COMISIONES POR VENTAS', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE COMISIONES A PERSONAS FISICAS, YA SEAN: PROFESIONISTAS, TECNICO, EXPERTOS O PERITOS, ASI COMO A LAS PERSONAS MORALES, CON LAS CUALES SE TENGA CELEBRADO CONTRATO RESPECTIVO, POR LOS SERVICIOS DE VENTA PRESTADOS A LAS ENTIDADES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(902, 346, 'SERVICIOS FINANCIEROS, BANCARIOS Y COMERCIALES INTEGRALES', 'OTROS SERVICIOS FINANCIEROS, BANCARIOS Y COMERCIALES NO PREVISTOS EN LAS DEMAS PARTIDAS ANTERIORES DE ESTE CONCEPTO. INCLUYE CASETAS TELEFONICAS SIN OPERAR LAS REDES ALAMBRICAS, RECEPCION DE LLAMADAS TELEFONICAS Y PROMOCION POR TELEFONO DE BIENES Y SERVICIOS, DE RECEPCION DE LLAMADAS TELEFONICAS EN NOMBRE DE LOS CLIENTES. EXCLUYE: CALCULO DE IMPUESTOS Y PREPARACION DE FORMATOS PARA LA DECLARACION DE IMPUESTOS, AL PROCESAMIENTO DE DATOS, A LA OPERACION DE REDES DE TELEFONIA TRADICIONAL, VENTA DE PRODUCTOS POR TELEFONO, Y A LOS SERVICIOS DE CORREO ELECTRONICO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(903, 347, 'CONSERVACION Y MANTTO. MENOR DE INMUEBLES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE CONSERVACION Y MANTENIMIENTO MENOR DE EDIFICIOS, LOCALES, TERRENOS, PREDIOS, AREAS VERDES Y CAMINOS DE ACCESO, PROPIEDAD O AL SERVICIO DEL PODER LEGISLATIVO, CUANDO SE EFECTUEN POR CUENTA DE TERCEROS, INCLUIDO EL PAGO DE DEDUCIBLES DE SEGUROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161);
