(904, 348, 'INSTALACION, MANTTO. Y REPARACION DE MOBILIARIO Y EQUIPO DE ADMINISTRACION', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE INSTALACION, REPARACION Y MANTENIMIENTO DE TODA CLASE DE MOBILIARIO Y EQUIPO DE ADMINISTRACION, TALES COMO: ESCRITORIOS, SILLAS, SILLONES, ARCHIVEROS, MAQUINAS DE ESCRIBIR, CALCULADORAS, FOTOCOPIADORAS, ENTRE OTROS. INCLUYE EL PAGO DE DEDUCIBLES DE SEGUROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(905, 349, 'INSTALACION, MANTTO. Y REPARACION DE BIENES ARTISTICOS Y CULTURALES', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR MANTENIMIENTO Y CONSERVACION DE  BIENES MUEBLES,  ARTISTICOS O CULTURALES COMO SON: PINTURAS, ESCULTURAS, CUADROS, COLECCIONES DIVERSAS, EDICIONES HISTORICAS, EQUIPOS MUSICALES PARA BANDAS Y ORQUESTAS, Y EN GENERAL TODOS LOS BIENES QUE CONSTITUYAN EL ACERVO PATRIMONIAL ARTISTICO Y CULTURAL, ASIGNADOS AL PODER LEGISLATIVO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(906, 350, 'INSTALACION, MANTTO. Y REPARACION DE MOBILIARIO Y EQUIPO EDUCACIONAL Y RECREATIVO', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE INSTALACION, REPARACION Y MANTENIMIENTO DE TODA CLASE DE MOBILIARIO Y EQUIPO DE EDUCACIONAL Y RECREATIVO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(907, 351, 'INSTALACION, MANTENIMIENTO Y REPARACION DE EQUIPO  DE COMPUTO  Y TECNOLOGIA  DE LA INFORMACION', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS QUE SE CONTRATEN CON TERCEROS PARA LA INSTALACION, REPARACION Y MANTENIMIENTO DE EQUIPOS DE COMPUTO Y TECNOLOGIAS DE LA INFORMACION, TALES COMO: COMPUTADORAS, IMPRESORAS, DISPOSITIVOS DE SEGURIDAD, REGULADORES, FUENTES DE POTENCIA ININTERRUMPIDA, ENTRE OTROS. INCLUYE EL PAGO DE DEDUCIBLES DE SEGUROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(908, 352, 'INSTALACION, MANTTO Y REP. DE EQUIPO E INSTRUMENTAL MEDICO Y DE LABORATORIO', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE INSTALACION, REPARACION Y MANTENIMIENTO DE EQUIPO E INSTRUMENTAL MEDICO Y DE LABORATORIO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(909, 353, 'MANTTO. Y REPARACION DE EQUIPO DE TRANSPORTE', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE REPARACION Y MANTENIMIENTO DEL EQUIPO DE TRANSPORTE TERRESTRE, AEROESPACIAL, MARITIMO, LACUSTRE Y FLUVIAL, E INSTALACION DE EQUIPOS EN LOS MISMOS, PROPIEDAD O AL SERVICIO DEL PODER LEGISLATIVO.(EXCLUYE CAUSAS IMPUTABLES A SERVIDORES PUBLICOS)', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(910, 354, 'MANTTO. Y REPARACION DE EQUIPO DE DEFENSA Y SEGURIDAD', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DEL SERVICIO DE MANO DE OBRA Y/O PIEZAS NECESARIAS PARA LA CONSERVACION DE ARMAMENTO EN GENERAL, ASIGNADO A LAS ENTIDADES DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(911, 355, 'INSTALACION, MANTTO. Y REPARACION DE MAQUINARIA  OTROS EQUIPOS Y HERRAMIENTA', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE INSTALACION, REPARACION Y MANTENIMIENTO DE LA MAQUINARIA, OTROS EQUIPOS Y HERRAMIENTA, PROPIEDAD O AL SERVICIO DE LOS ENTES PUBLICOS TALES COMO: TRACTORES, PALAS MECANICAS, DRAGAS, FERTILIZADORAS, VEHICULOS, EQUIPO ESPECIALIZADO INSTALADO EN LOS INMUEBLES, ENTRE OTROS, CUANDO SE EFECTUEN POR CUENTA DE TERCEROS. INCLUYE EL MANTENIMIENTO DE PLANTAS E INSTALACIONES PRODUCTIVAS Y EL PAGO DE DEDUCIBLES DE SEGUROS. (EXCLUYE CAUSAS IMPUTABLES A SERVIDORES PUBLICOS).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(912, 356, 'INSTALACION, MANTTO. Y REPARACION DE HERRAMIENTAS Y OTROS EQUIPOS (INHABILITADA)', 'ASIGNACIONES DESTINADAS A CUBRIR EL MANTENIMIENTO DE TODA CLASE DE HERRAMIENTAS PROPIEDAD O AL SERVICIO DEL PODER LEGISLATIVO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(913, 357, 'SERVICIOS DE LAVANDERIA, HIGIENE Y MANEJO DE DESECHOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR EL SERVICIO DE: LAVANDERIA, TINTORERIA, LIMPIEZA, DESINFECCION E HIGIENE DE LAS INSTALACIONES PERTENECIENTES AL PODER LEGISLATIVO QUE POR LA NATURALEZA DE SUS FUNCIONES LO REQUIERAN. INCLUYE SERVICIOS DE DRENAJE Y RECOLECCION DE BASURA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(914, 358, 'TRATAMIENTO DE RESIDUOS PELIGROSOS', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DEL SERVICIO POR  MANEJO Y TRATAMIENTO DE RESIDUOS PELIGROSOS DERIVADOS DE LAS ACTIVIDADES DEL SECTOR SALUD.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(915, 359, 'SERVICIOS DE JARDINERIA Y FUMIGACION', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONTROL Y EXTERMINACION DE PLAGAS, INSTALACION Y MANTENIMIENTO DE AREAS VERDES COMO LA PLANTACION, FERTILIZACION Y PODA DE ARBOLES, PLANTAS Y HIERBAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(916, 361, 'DIFUSION SOBRE PROGRAMAS Y ACTIVIDADES GUBERNAMENTALES', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE DIFUSION DEL QUEHACER LEGISLATIVO A TRAVES DE LOS DIVERSOS MEDIOS MASIVOS DE COMUNICACION.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(917, 362, 'PUBLICACION Y DIVULGACION DE MENSAJES PARA PROMOCION DE BIENES O SERVICIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LA PUBLICIDAD DERIVADA DE LA COMERCIALIZACION DE LOS PRODUCTOS O SERVICIOS DE LOS ENTES PUBLICOS QUE GENERAN UN INGRESO PARA EL ESTADO. EXCLUYE LOS GASTOS DE DIFUSION DE MENSAJES QUE NO COMERCIALIZAN PRODUCTOS O SERVICIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(918, 363, 'IMPRESOS Y PUBLICACIONES OFICIALES', 'CANTIDADES DESTINADAS A CUBRIR EROGACIONES POR PROMOCION, DIFUSION Y PUBLICIDAD  A TRAVES DE LOS DIVERSOS MEDIOS DE COMUNICACION PARA DAR A CONOCER LOS SERVICIOS QUE PRESTA EL PODER LEGISLATIVO; ASI COMO LA  IMPRESION DE PAPELERIA OFICIAL, VALES DE COMBUSTIBLES, SELLOS OFICIALES, MEMBRETES, FORMATOS, INSTRUCTIVOS, TRIPTICOS, CARTELES, TRABAJOS SERIGRAFICOS Y ENCUADERNACION DE MEMORIAS DE EVENTOS, PARA LA IDENTIFICACION Y REALIZACION DE TRAMITES ADMINISTRATIVOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(919, 364, 'SERVICIOS DE CREATIVIDAD, PREPRODUCCION Y PRODUCCION DE PUBLICIDAD', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR DISEÑO Y CONCEPTUALIZACION DE CAMPAÑAS DE COMUNICACION, PREPRODUCCION, PRODUCCION Y COPIADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(920, 365, 'SERVICIOS DE REVELADO DE FOTOGRAFIAS', 'ASIGNACIONES DESTINADAS A CUBRIR GASTOS POR CONCEPTO DE REVELADO O IMPRESION DE FOTOGRAFIAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(921, 366, 'SERVICIOS DE LA INDUSTRIA FILMICA, DEL SONIDO Y DEL  VIDEO', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR POSTPRODUCCION (DOBLAJE, TITULAJE, SUBTITULAJE, EFECTOS VISUALES, ANIMACION, EDICION, CONVERSION DE FORMATO, COPIADO DE VIDEOS, ENTRE OTROS) Y A OTROS SERVICIOS PARA LA INDUSTRIA FILMICA Y DEL VIDEO COMO LA CRESTOMATIA Y LOS SERVICIOS PRESTADOS POR LOS LABORATORIOS FILMICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(922, 367, 'SERVICIOS DE CREACION Y DIFUSION POR INTERNET', 'ASIGNACIONES DESTINADAS A CUBRIR EL GASTO POR CREACION, DIFUSION Y TRANSMISION DE CONTENIDO DE INTERES GENERAL O ESPECIFICO A TRAVES DE INTERNET EXCLUSIVAMENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(923, 368, 'OTROS SERVICIOS DE INFORMACION', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LA CONTRATACION DE SERVICIOS PROFESIONALES CON PERSONAS FISICAS O MORALES, POR CONCEPTO DE MONITOREO DE INFORMACION EN MEDIOS MASIVOS DE COMUNICACION, DE LAS ACTIVIDADES DE LOS ENTES PUBLICOS, QUE NO SE ENCUENTREN COMPRENDIDAS EN LAS DEMAS PARTIDAS DE ESTE CAPITULO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(924, 369, 'PASAJES AEREOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONCEPTO DE TRASLADO DE PERSONAL POR VIA AEREA QUE SE UTILICEN EN EL CUMPLIMIENTO DE SUS FUNCIONES PUBLICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(925, 370, 'PASAJES TERRESTRES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONCEPTO DE TRASLADO DE PERSONAL POR VIA TERRESTRE URBANO Y SUBURBANO, INTERURBANO Y RURAL, TAXIS Y FERROVIARIO, EN CUMPLIMIENTO DE SUS FUNCIONES PUBLICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(926, 371, 'PASAJES MARITIMOS, LACUSTRES Y FLUVIALES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONCEPTO DE TRASLADO DE PERSONAL POR VIA MARITIMA, LACUSTRE Y FLUVIAL EN CUMPLIMIENTO DE SUS FUNCIONES PUBLICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(927, 372, 'AUTOTRANSPORTE', 'ASIGNACIONES DESTINADAS AL AUTOTRANSPORTE TANTO DE MERCANCIAS QUE NO REQUIEREN DE EQUIPO ESPECIALIZADO Y QUE NORMALMENTE SE TRANSPORTAN EN CAMIONES DE CAJA O EN CONTENEDORES, COMO DE AQUELLOS PRODUCTOS QUE POR SUS CARACTERISTICAS (LIQUIDOS, GASES, ETC.) REQUIEREN SER TRANSPORTADOS EN CAMIONES CON EQUIPO ESPECIALIZADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(928, 373, 'PEAJES Y PUENTES', 'CANTIDADES DESTINADAS A CUBRIR GASTOS CON MOTIVO DEL USO O SERVICIO DE CARRETERAS Y PUENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(929, 374, 'VIATICOS EN EL PAIS', 'ASIGNACIONES DESTINADAS A CUBRIR AL PERSONAL DEL PODER LEGISLATIVO, EL COSTO DE ALIMENTACION, HOSPEDAJE Y ARRENDAMIENTO DE VEHICULOS QUE POR NECESIDAD DEL SERVICIO TENGAN QUE TRASLADARSE A LUGARES DISTINTOS A LOS DE SU ADSCRIPCION, PARA EL CUMPLIMIENTO DE COMISIONES OFICIALES APLICANDO  PARA TAL CASO LAS CUOTAS QUE SEÑALE EL TABULADOR VIGENTE. EXCLUYE LOS GASTOS DE PASAJES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(930, 375, 'VIATICOS EN EL EXTRANJERO', 'ASIGNACION SUJETA A COMPROBACION DE ACUERDO A LA NORMATIVIDAD EN LA MATERIA, PARA CUBRIR LA ALIMENTACION, HOSPEDAJE Y ARRENDAMIENTO DE VEHICULOS DE LOS SERVIDORES PUBLICOS QUE POR COMISIONES DEBAN ASISTIR AL EXTRANJERO PARA CUMPLIR CON FUNCIONES PROPIAS DE SU ACTIVIDAD, APLICANDO PARA TAL CASO LAS CUOTAS QUE SEÑALE EL TABULADOR VIGENTE. EXCLUYE LOS GASTOS DE PASAJES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(931, 376, 'GASTOS DE INSTALACION  Y TRASLADO DE MENAJE', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS QUE OCASIONE LA INSTALACION DEL PERSONAL AL SERVICIO DEL PODER LEGISLATIVO, CUANDO EN EL DESEMPEÑO DE FUNCIONES OFICIALES DENTRO O FUERA DEL PAIS, SE REQUIERA SU PERMANENCIA FUERA DE SU RESIDENCIA EN FORMA TRANSITORIA O PERMANENTE, INCLUYENDO, EN SU CASO, EL TRASLADO DE MENAJE DE CASA. EXCLUYE LOS PAGOS DE VIATICOS Y PASAJES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(932, 377, 'SERVICIOS INTEGRALES  DE TRASLADO  Y VIATICOS', 'ASIGNACIONES DESTINADAS A CUBRIR LAS EROGACIONES QUE REALICEN EL PODER LEGISLATIVO POR LA CONTRATACION CON PERSONAS FISICAS Y MORALES DE SERVICIOS DIVERSOS CUYA DESAGREGACION NO ES REALIZABLE EN FORMA ESPECIFICA PARA CADA UNA DE LAS PARTIDAS DE GASTO DE ESTE CONCEPTO, POR TRATARSE DE UNA COMBINACION DE SERVICIOS RELACIONADOS CUYA PRESTACION SE ESTIPULA EN FORMA INTEGRAL Y QUE EN TERMINOS DEL COSTO TOTAL RESULTA EN CONDICIONES MENOS ONEROSAS PARA EL PODER LEGISLATIVO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(933, 378, 'GASTOS EN COMISION', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DE ALIMENTACION DEL PERSONAL QUE REALIZA TRABAJOS EXTRAORDINARIOS FUERA DEL HORARIO NORMAL DE LABORES, Y AQUELLOS QUE SE DERIVEN DE COMISIONES QUE NO AMERITE EL PAGO DE VIATICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(934, 379, 'OTROS SERVICIOS DE TRASLADO Y HOSPEDAJE', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE SERVICIOS BASICOS DISTINTOS DE LOS SEÑALADOS EN LAS PARTIDAS DE ESTE CONCEPTO, TALES COMO PENSIONES DE ESTACIONAMIENTO, ENTRE OTROS, REQUERIDOS EN EL DESEMPEÑO DE FUNCIONES OFICIALES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(935, 380, 'GASTOS CEREMONIALES, DE ORDEN SOCIAL Y FOMENTO DE ACTIVIDADES CIVICAS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS SERVICIOS INTEGRALES QUE SE CONTRATEN CON MOTIVO DE ORGANIZACION Y EJECUCION DE RECEPCIONES DE LOS TITULARES DE LOS ENTES PUBLICOS AL PERSONAL DEL CUERPO DIPLOMATICO ACREDITADO, AL C. PRESIDENTE DE LA REPUBLICA Y PERSONALIDADES NACIONALES O EXTRANJERAS RESIDENTES O DE VISITA EN EL ESTADO. INCLUYE BIENES Y SERVICIOS TALES COMO: ORGANIZACION Y EJECUCION DE RECEPCIONES, ADORNOS, ESCENOGRAFIA, ENTRE OTROS. ASIMISMO LOS GASTOS QUE SE ORIGINEN CON MOTIVO DE LA CELEBRACION DE ACTOS CONMEMORATIVOS Y DE ORDEN SOCIAL, TALES COMO LA REALIZACION DE CEREMONIAS PATRIOTICAS Y OFICIALES, DESFILES, ADQUISICION DE OFRENDAS FLORALES Y LUCTUOSAS, RENTA DE SILLAS, LONAS Y SONIDO, APOYOS EN DINERO O EN ESPECIE AL PODER LEGISLATIVO, CUYAS ACTIVIDADES ESTEN DEDICADAS A FORTALECER Y SALVAGUARDAR LOS ACTOS CIVICOS, EN LOS QUE PARTICIPAN EL TITULAR DEL EJECUTIVO ESTATAL O MUNICIPAL, FUNCIONARIOS Y SERVIDORES PUBLICOS. NO PROCEDERA CARGAR A ESTA PARTIDA COMPRA O MANTENIMIENTO DE MOBILIARIO, EQUIPO O DEMAS ACTIVO FIJO, MATERIAL DE OFICINA Y EN GENERAL GASTOS DE OPERACION NORMALES. (GASTO CORRIENTE).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(936, 381, 'SERVICIOS DE GESTION SOCIAL', 'EROGACIONES DESTINADAS PARA EL APOYO DE GESTIONES SOCIALES QUE REALIZA EL H. CONGRESO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(937, 382, 'REUNIONES, CONGRESOS Y CONVENCIONES', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE PREPARACION Y DESARROLLO DE CONGRESOS, ASAMBLEAS, REUNIONES DE TRABAJO Y CONVENCIONES; ACONDICIONAMIENTO DEL LOCAL; ALQUILER DE LOCAL Y EQUIPO; PAGO DE INDEMNIZACIONES POR DAÑOS QUE EVENTUALMENTE SUFRAN LOS BIENES UTILIZADOS EN LAS MISMAS, COSTO DE TRANSMISIONES POR RADIO Y TELEVISION, CUOTAS DE INSCRIPCION A CONGRESOS Y CONVENCIONES; INVITACIONES, ALIMENTACION, HOSPEDAJE Y TRANSPORTE DE LOS PARTICIPANTES; PROPAGANDA; HONORARIOS Y GRATIFICACIONES POR SERVICIOS PROFESIONALES INDEPENDIENTES DE MAESTROS DE CEREMONIAS, EDECANES Y TRADUCTORES; ENTRE OTROS. NO PROCEDERA CARGARSE A ESTA PARTIDA COMPRA O MANTENIMIENTO DE MOBILIARIO, EQUIPO O DEMAS ACTIVO FIJO, MATERIAL DE OFICINA Y EN GENERAL GASTOS DE OPERACION NORMAL DEL PODER LEGISLATIVO (GASTO CORRIENTE).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(938, 383, 'EXPOSICIONES Y ESPECTACULOS', 'CANTIDADES DESTINADAS A CUBRIR LOS GASTOS QUE SE GENEREN EN EL MONTAJE DE ESPECTACULOS Y EXPOSICIONES: ALQUILER DE LOCAL Y EQUIPO, SEGURO, INSTALACION, GASTOS DE ALIMENTACION Y HOSPEDAJE DE EXPOSITORES, INVITACIONES, PROPAGANDA, COSTO DE TRANSMISION POR RADIO Y TELEVISION, CUOTAS DE INSCRIPCION, EDECANES, ENTRE OTROS; PAGO DE INSUMOS Y SERVICIOS QUE SE REQUIERAN DIRECTAMENTE PARA LA REALIZACION DEL EVENTO, ADAPTACION Y DECORACIONES, ALOJAMIENTO DE ASISTENTES FORANEOS, COSTO DE ALIMENTOS, HONORARIOS A MAESTROS DE CEREMONIAS, ACTORES Y GRUPOS MUSICALES, ENTRE OTROS, QUE INCIDAN DIRECTAMENTE CON EL DESARROLLO DE DICHOS EVENTOS. INCLUYE EL PAGO DE INDEMNIZACIONES POR LOS DAÑOS QUE SUFRAN LOS BIENES EXPUESTOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(939, 385, 'GASTOS DE REPRESENTACION', 'ASIGNACIONES DESTINADAS A CUBRIR GASTOS AUTORIZADOS A LOS SERVIDORES PUBLICOS DE MANDOS MEDIOS Y SUPERIORES POR CONCEPTO DE ATENCION A ACTIVIDADES INSTITUCIONALES ORIGINADAS POR EL DESEMPEÑO DE LAS FUNCIONES ENCOMENDADAS PARA LA CONSECUCION DE LOS OBJETIVOS DEL PODER LEGISLATIVO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(940, 386, 'PAGOS DE DEFUNCION', 'ASIGNACIONES DESTINADAS A CUBRIR SERVICIOS Y PAGAS DE DEFUNCION COMO TRASLADO DE CUERPOS, VELACION, APOYO PARA TRAMITES LEGALES, CREMACION Y EMBALSAMIENTO Y ATAUDES, A LOS FAMILIARES DE SERVIDORES PUBLICOS, CIVILES Y MILITARES AL SERVICIO DEL PODER LEGISLATIVO, ASI COMO DE PENSIONISTAS DIRECTOS, CUYO PAGO ES CON CARGO AL ERARIO. INCLUYE LOS GASTOS POR CONCEPTO DE HONORES POSTUMOS A QUIENES POR SUS MERITOS O SERVICIOS SE CONSIDERE CONVENIENTE TRIBUTAR.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(941, 387, 'IMPUESTOS y DERECHOS', 'CANTIDADES DESTINADAS A CUBRIR IMPUESTOS O DERECHOS CON MOTIVO DEL USO O SERVICIO DE RADIOCOMUNICACIONES; LEGALIZACION DE EXHORTOS, DE REGISTRO PUBLICO DE LA PROPIEDAD, IMPUESTO PREDIAL Y TRASLADO DE DOMINIO;  ASI COMO DERECHOS POR LA PRESTACION DE SERVICIOS, SE INCLUYEN GASTOS AEROPORTUARIOS (ESPACIO AEREO, ATERRIZAJE , REGUARDO DE AERONAVES ASI COMO AQUELLOS GASTOS QUE SE GENEREN PARA EL TRAMITE DE DERECHOS QUE SE REALICEN A DIFERENTES INSTANCIAS POR EL USO DE LAS AERONAVES)', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(942, 388, 'IMPUESTOS Y DERECHOS VEHICULARES', 'CANTIDADES DESTINADAS A CUBRIR GASTOS POR CANJE DE PLACAS,  REGISTRO DE CONTROL  VEHICULAR, IMPUESTOS Y TENENCIA DE VEHICULOS DEL PODER LEGISLATIVO, ENTRE OTROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
