(944, 390, 'SENTENCIAS Y RESOLUCIONES JUDICIALES', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE OBLIGACIONES O INDEMNIZACIONES DERIVADAS DE RESOLUCIONES EMITIDAS POR LA  AUTORIDAD COMPETENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(945, 391, 'PENAS, MULTAS, ACCESORIOS Y ACTUALIZACIONES', 'ASIGNACIONES DESTINADAS A CUBRIR LAS EROGACIONES DERIVADAS DEL PAGO EXTEMPORANEO DE PASIVOS FISCALES, ADEUDOS U OBLIGACIONES DE PAGO, COMO MULTAS, ACTUALIZACIONES, INTERESES Y DEMAS ACCESORIOS POR DICHOS PAGOS. INCLUYE LOS GASTOS FINANCIEROS POR PAGO EXTEMPORANEO DE ESTIMACIONES Y DE AJUSTE DE COSTOS DE OBRA PUBLICA, ASI COMO LOS GASTOS NO RECUPERABLES DERIVADOS DE LA TERMINACION ANTICIPADA DE CONTRATOS DE ADQUISICIONES U OBRAS PUBLICAS. EXCLUYE CAUSAS IMPUTABLES A SERVIDORES PUBLICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(946, 392, 'PERDIDAS AL ERARIO Y OTROS GASTOS POR RESPONSABILIDAD', 'EROGACIONES DEL PODER LEGISLATIVO QUE SE DERIVEN DEL ROBO O EXTRAVIO, ENTRE OTROS, DE RECURSOS PUBLICOS QUE NO SEAN RECUPERABLES E IMPLIQUEN AFECTAR SU TECHO PRESUPUESTARIO DISPONIBLE. EXCLUYE LAS RECUPERACIONES DE RECURSOS QUE SE REALICEN POR LOS DIVERSOS MEDIOS ESTABLECIDOS POR LAS DISPOSICIONES APLICABLES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
