(961, 484, 'SERVICIOS DE APOYO ADMINISTRATIVO, FOTOCOPIADO E IMPRESION', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LA CONTRATACION DE SERVICIOS DE FOTOCOPIADO Y PREPARACION DE DOCUMENTOS; DIGITALIZACION DE DOCUMENTOS OFICIALES, FAX, ENGARGOLADO, ENMICADO, ENCUADERNACION, CORTE DE PAPEL, RECEPCION DE CORRESPONDENCIA Y OTROS AFINES. INCLUYE SERVICIOS DE APOYO SECRETARIAL, SERVICIOS DE ESTENOGRAFIA EN LOS TRIBUNALES, TRANSCRIPCION SIMULTANEA DE DIALOGOS PARA LA TELEVISION, REUNIONES Y CONFERENCIAS; SERVICIOS COMERCIALES NO PREVISTOS EN LAS DEMAS PARTIDAS ANTERIORES. INCLUYE SERVICIOS DE IMPRESION DE DOCUMENTOS OFICIALES NECESARIOS TALES COMO: PASAPORTES, CERTIFICADOS ESPECIALES, TITULOS DE CREDITO, FORMAS FISCALES Y FORMAS VALORADAS, Y DEMAS DOCUMENTOS PARA LA IDENTIFICACION, TRAMITES OFICIALES Y SERVICIOS A LA POBLACION; SERVICIOS DE IMPRESION Y ELABORACION DE MATERIAL INFORMATIVO, TALES COMO: PADRONES DE BENEFICIARIOS, REGLAS DE OPERACION, PROGRAMAS SECTORIALES, REGIONALES, ESPECIALES; INFORMES DE LABORES, MANUALES DE ORGANIZACION, DE PROCEDIMIENTOS Y DE SERVICIOS AL PUBLICO; DECRETOS, CONVENIOS, ACUERDOS, INSTRUCTIVOS, PROYECTOS EDITORIALES (LIBROS, REVISTAS Y GACETAS PERIODICAS),\r\n FOLLETOS, TRIPTICOS, DIPTICOS, CARTELES, MANTAS, ROTULOS, Y DEMAS SERVICIOS DE IMPRESION Y ELABORACION DE MATERIAL INFORMATIVO. INCLUYE GASTOS COMO: AVISOS, PRECISIONES, CONVOCATORIAS, EDICTOS, BASES, LICITACIONES, DIARIO OFICIAL, CONCURSOS Y ACLARACIONES, Y DEMAS INFORMACION EN MEDIOS MASIVOS. EXCLUYE LAS INSERCIONES DERIVADAS DE CAMPAÑAS PUBLICITARIAS Y DE COMUNICACION SOCIAL, LAS CUALES SE DEBERAN REGISTRAR EN LAS PARTIDAS CORRESPONDIENTES AL CONCEPTO 3600 SERVICIOS DE COMUNICACION SOCIAL Y PUBLICIDAD.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 161),
(962, 4, 'SUELDOS PARA BASE', 'IMPORTE DESTINADO A CUBRIR REMUNERACIONES POR CONCEPTO DE SUELDO BASE Y DIAS DE AJUSTE ANUAL, AL PERSONAL DEL PODER JUDICIAL QUE CUENTE CON NOMBRAMIENTO DE BASE,  CONFORME AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
