(971, 16, 'RETROACTIVO DE SUELDOS APC PARA CONTRATO', 'CANTIDAD DESTINADA A CUBRIR EL SUELDO RETROACTIVO AL PERSONAL DE CONTRATO DEL PODER JUDICIAL, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(972, 17, 'SUELDOS PARA CONTRATO CONFIANZA', 'IMPORTE QUE SE DESTINA A CUBRIR REMUNERACIONES POR CONCEPTO DE SUELDO Y DIAS DE AJUSTE AL PERSONAL QUE ESTA SUJETO A UNA RELACION LABORAL DE CONTRATO CONFIANZA E  INDIVIDUAL DE TRABAJO CON EL PODER JUDICIAL, DE ACUERDO AL CATALOGO DE PUESTOS Y AL TABULADOR DE SUELDOS Y SALARIOS VIGENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
