(974, 19, 'RETRIBUCIONES POR SERVICIOS DE CARACTER SOCIAL', 'REMUNERACION A PROFESIONISTAS O ESTUDIANTES DE LAS DIVERSAS CARRERAS O ESPECIALIDADES TECNICAS QUE PRESTEN SU SERVICIO SOCIAL AL PODER JUDICIAL. CONSIDERADO UNICAMENTE POR EL PERIODO QUE LA NORMATIVIDAD ESTABLECE PARA ESTE TIPO DE SERVICIO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
