(1165, 318, 'ARRENDAMIENTOS DE ACTIVOS INTANGIBLES', 'ASIGNACIONES DESTINADAS A CUBRIR EL IMPORTE QUE CORRESPONDA POR EL USO DE PATENTES Y MARCAS, REPRESENTACIONES COMERCIALES E INDUSTRIALES, REGALIAS POR DERECHOS DE AUTOR, MEMBRECIAS, ASI COMO LICENCIAS DE USO DE PROGRAMAS DE COMPUTO Y SU ACTUALIZACION.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162);
