(1166, 319, 'ARRENDAMIENTO FINANCIERO', 'CANTIDAD DESTINADA A CUBRIR EL IMPORTE DE INTERESES, AMORTIZACIONES, COMISIONES Y ARRENDAMIENTO DE UN BIEN MUEBLE O INMUEBLE A UNA COMPAÑIA ESPECIALIZADA EN ARRENDAMIENTO FINANCIERO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1167, 320, 'OTROS ARRENDAMIENTOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL ALQUILER DE TODA CLASE DE ELEMENTOS NO CONTEMPLADOS EN OTRAS CLASIFICACIONES, SILLAS, MESAS, UTENSILIOS DE COCINA, MANTELERIA, LONAS, CARPAS Y SIMILARES PARA OCASIONES ESPECIALES. INSTRUMENTOS MUSICALES. EQUIPO MEDICO COMO MULETAS Y TANQUES DE OXIGENO. EQUIPO Y VEHICULOS RECREATIVOS Y DEPORTIVOS REQUERIDOS EN EL CUMPLIMIENTO DE LAS FUNCIONES OFICIALES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1168, 321, 'SERVICIOS LEGALES, DE CONTABILIDAD, AUDITORIA Y RELACIONADOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE SERVICIOS PROFESIONALES INDEPENDIENTES CONTRATADOS POR EL PODER JUDICIAL PARA ASESORAMIENTO Y CONSULTORIA EN MATERIA JURIDICA, CONTABLE, INGENIERIA, ARQUITECTONICA Y AUDITORIA EXTERNA ENTRE OTROS, PARA EL MEJOR DESEMPEÑO DE SUS FUNCIONES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1169, 322, 'SERVICIOS DE DISEÑO, ARQUITECTURA, INGENIERIA Y ACTIVIDADES RELACIONADAS', 'ASIGNACIONES DESTINADAS A CUBRIR SERVICIOS DE ARQUITECTURA, ARQUITECTURA DE PAISAJE, URBANISMO, INGENIERIA CIVIL, MECANICA, ELECTRONICA, EN PROCESO DE PRODUCCION Y  ACTIVIDADES RELACIONADAS COMO SERVICIOS DE DIBUJO, INSPECCION DE EDIFICIOS, LEVANTAMIENTO GEOFISICO, ELABORACION DE MAPAS, SERVICIOS PRESTADOS POR LABORATORIOS DE PRUEBAS. CREACION Y DESARROLLO DE DISEÑOS PARA OPTIMIZAR EL USO, VALOR Y APARIENCIA DE PRODUCTOS COMO MAQUINARIA, MUEBLES, AUTOMOVILES, HERRAMIENTAS Y GRAFICO. EXCLUYE: DISEÑO DE SISTEMAS DE COMPUTO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1170, 323, 'SERVICIOS DE CONSULTORIA ADMINISTRATIVA, DE PROCESOS, TECNICA Y EN TECNOLOGIAS DE LA INFORMACION', 'ASIGNACIONES DESTINADAS A CUBRIR LOS SERVICIOS EN EL CAMPO DE LAS TECNOLOGIAS DE INFORMACION A TRAVES DE ACTIVIDADES COMO PLANEACION Y DISEÑO DE SISTEMAS DE COMPUTO QUE INTEGRAN HARDWARE Y SOFTWARE Y TECNOLOGIAS DE COMUNICACION, ASESORIA EN LA INSTALACION DE EQUIPO Y REDES INFORMATICAS, ADMINISTRACION DE CENTROS DE COMPUTO Y SERVICIOS DE INSTALACION DE SOFTWARE, CONSULTORIA ADMINISTRATIVA (ADMINISTRACION GENERAL, FINANCIERA, ORGANIZACIONAL, RECURSOS HUMANOS),\r\n CIENTIFICA Y TECNICA (EN BIOLOGIA, QUIMICA, ECONOMIA, SOCIOLOGIA, ESTADISTICA, GEOGRAFIA, MATEMATICAS, FISICA, AGRICULTURA, DESARROLLOS TURISTICOS, SEGURIDAD Y OTROS NO CLASIFICADOS EN OTRA PARTE). INCLUYE PLANEACION, DISEÑO Y DESARROLLO DE PROGRAMAS COMPUTACIONALES. EXCLUYE: SERVICIOS DE INVESTIGACION DE MERCADOS Y ENCUESTAS DE OPINION PUBLICA, SERVICIOS DE INVESTIGACION Y DESARROLLO CIENTIFICO, SERVICIOS DE ADMINISTRACION DE NEGOCIOS, CONSULTORIA EN PSICOLOGIA, EDUCACION Y SERVICIOS DE EMPLEO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1171, 324, 'CAPACITACION Y DESARROLLO DE PERSONAL', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO  DEL DESARROLLO Y PREPARACION DE CURSOS, SEMINARIOS, SIMPOSIUMS, INCLUYE HONORARIOS PARA EXPOSITORES, INSCRIPCION A CURSOS DE CAPACITACION Y/O ACTUALIZACION DE LOS SERVIDORES PUBLICOS DEL PODER JUDICIAL EN TERRITORIO NACIONAL E INTERNACIONAL.  NO PROCEDE CARGAR A ESTA PARTIDA: ADQUISICION O REPARACION DE ACTIVOS FIJOS, MATERIAL PARA OFICINA Y EN GENERAL GASTOS DE OPERACION NORMAL DEL PODER JUDICIAL (GASTO CORRIENTE). EXCLUYE LAS ESROGACIONES POR CAPACITACION CORRESPONDIENTES A LAS PRESTACIONES COMPRENDIDAS EN EL CAPITULO 1000 SERVICIOS PERSONALES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1172, 325, 'SERVICIOS DE INVESTIGACION CIENTIFICA Y DESARROLLO', 'ASIGNACIONES DESTINADAS A CUBRIR LA INVESTIGACION Y DESARROLLO EN CIENCIAS FISICAS, DE LA VIDA (BIOLOGIA, BOTANICA, BIOTECNOLOGIA, MEDICINA, FARMACEUTICA, AGRICULTURA),\r\n INGENIERIA, QUIMICA, OCEANOGRAFIA, GEOLOGIA Y MATEMATICAS, CIENCIAS SOCIALES Y HUMANIDADES (ECONOMIA, SOCIOLOGIA, DERECHO, EDUCACION, LENGUAJE Y PSICOLOGIA).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1173, 326, 'SERVICIOS PARA PROGRAMAS ADICIONALES', 'CANTIDADES DESTINADAS A CUBRIR EL FINANCIAMIENTO DE PROGRAMAS ESPECIFICOS QUE SE LE AUTORICEN AL PODER JUDICIAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1174, 327, 'SERVICIOS DE PROTECCION Y SEGURIDAD', 'ASIGNACIONES DESTINADAS A LA REALIZACION DE PROGRAMAS, INVESTIGACIONES, ACCIONES Y ACTIVIDADES EN MATERIA DE SEGURIDAD PUBLICA Y NACIONAL, EN CUMPLIMIENTO DE FUNCIONES Y ACTIVIDADES OFICIALES, CUYA REALIZACION IMPLIQUE RIESGO, URGENCIA Y CONFIDENCIALIDAD EXTREMA. INCLUYE LOS RECURSOS PARA LA CONTRATACION TEMPORAL DE PERSONAS Y LA ADQUISICION DE MATERIALES Y SERVICIOS NECESARIOS PARA TALES EFECTOS. EN NINGUN CASO SE PODRAN SUFRAGAR CON CARGO A ESTA PARTIDA, EROGACIONES PREVISTAS EN OTROS CAPITULOS, CONCEPTOS Y PARTIDAS DE ESTE CLASIFICADOR CUANDO CORRESPONDA A PROGRAMAS, INVESTIGACIONES, ACCIONES Y ACTIVIDADES DIFERENTES DE LOS ESPECIALES SUJETOS A ESTA PARTIDA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1175, 328, 'SERVICIOS DE VIGILANCIA', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DEL SERVICIO DE VIGILANCIA QUE PROPORCIONA AL PODER JUDICIAL  LA POLICIA AUXILIAR, BANCARIA, INDUSTRIAL Y COMERCIAL, U OTRO ORGANISMO QUE GARANTICE EL SERVICIO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1176, 329, 'SERVICIOS PROFESIONALES, CIENTIFICOS Y TECNICOS INTEGRALES', 'SERVICIOS PROFESIONALES: NOTARIALES, DE INVESTIGACION DE MERCADOS, DE FOTOGRAFIA, TODO TIPO DE TRADUCCIONES ESCRITAS O VERBALES, VETERINARIOS, DE LABORATORIO PARA EXAMENES DE CONTROL DE CONFIANZA, SINODALES AERONAUTICOS, DE VALUACION DE METALES, PIEDRAS PRECIOSAS, OBRAS DE ARTE Y ANTIGÜEDADES, Y OTROS SERVICIOS PROFESIONALES, CIENTIFICOS Y TECNICOS NO CLASIFICADOS EN OTRA PARTIDA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1177, 330, 'GASTOS MEDICOS Y HOSPITALARIOS', 'CANTIDADES DESTINADAS A CUBRIR EL IMPORTE DE GASTOS DE HOSPITALIZACION, CIRUGIA, QUIROFANO, HONORARIOS MEDICOS Y DE LABORATORIO, ENTRE OTROS, PARA EL PERSONAL QUE NO ESTE ADSCRITO AL REGIMEN DEL INSTITUTO MEXICANO DEL SEGURO SOCIAL Y AL INSTITUTO DE SEGURIDAD  Y SERVICIOS SOCIALES DE LOS TRABAJADORES DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1178, 331, 'SUBROGACIONES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS QUE REALICEN LAS ENTIDADES  DEL SECTOR SALUD EN LA PRESTACION DE SERVICIOS, CUANDO NO LES SEA POSIBLE ATENDERLOS DE MANERA DIRECTA TALES COMO: MEDICAMENTOS, SERVICIOS MEDICOS, HOSPITALARIOS Y DE LABORATORIO  ENTRE OTROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1179, 332, 'COMISIONES Y SITUACIONES BANCARIAS', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DE TRASLADO, CUSTODIA DE VALORES Y SERVICIOS BANCARIOS NECESARIOS PARA EL MOVIMIENTO DE FONDOS. (SE EXCEPTUA EL PAGO DE COMISIONES POR SOBREGIRO).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1180, 333, 'COMISIONES Y GASTOS FINANCIEROS', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO FINANCIERO POR CONTRATACION DE CREDITOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1181, 334, 'SERVICIOS DE COBRANZA', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE COBRANZA, QUE REQUIERA EL PODER JUDICIAL CON MOTIVO DE LAS FUNCIONES QUE REALIZA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1182, 335, 'SERVICIOS DE INVESTIGACION CREDITICIA Y SIMILARES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR INVESTIGACION CREDITICIA Y RECOPILACION DE INFORMACION SOBRE SOLVENCIA FINANCIERA DE PERSONAS O NEGOCIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1183, 336, 'SERVICIOS DE RECAUDACION, TRASLADO Y CUSTODIA DE VALORES', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE SERVICIOS FINANCIEROS POR GUARDA, CUSTODIA, TRASLADO DE VALORES Y OTROS GASTOS INHERENTES A LA RECAUDACION.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1184, 337, 'SEGUROS DE RESPONSABILIDAD PATRIMONIAL', 'ASIGNACIONES DESTINADAS A CUBRIR LAS PRIMAS CON CARGO AL PRESUPUESTO AUTORIZADO DE LOS ENTES PUBLICOS, POR CONCEPTO DE LA CONTRATACION DEL SEGURO DE RESPONSABILIDAD PATRIMONIAL DEL ESTADO, QUE PERMITA CON LA SUMA ASEGURADA CUBRIR EL MONTO EQUIVALENTE A LAS INDEMNIZACIONES Y QUE CORRESPONDERAN A LA REPARACION INTEGRAL DEL DAÑO Y, EN SU CASO, POR EL DAÑO PERSONAL Y MORAL, QUE SE OCASIONEN COMO CONSECUENCIA DE LA ACTIVIDAD ADMINISTRATIVA IRREGULAR DEL ESTADO. EXCLUYE EL MONTO DE LAS EROGACIONES QUE RESULTEN POR INSUFICIENCIA DE LA SUMA ASEGURADA CONTRA EL COSTO DE LA INDEMNIZACION Y, EN SU CASO, LOS DEDUCIBLES CORRESPONDIENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1185, 338, 'SEGUROS POR CREDITOS', 'ASIGNACIONES DESTINADAS A CUBRIR  EL IMPORTE DE PRIMAS POR SEGUROS CONTRATADOS PARA GARANTIZAR EL PAGO SOBRE PRESTAMOS QUIROGRAFARIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1186, 339, 'FIANZAS PARA PRELIBERACION', 'DEPOSITOS AL FONDO DE PROCURACION DE JUSTICIA, QUE SE DERIVAN DE GARANTIAS O AFIANZAMIENTO DE INDICIADOS EN PROCESOS JUDICIALES PARA LA REPARACION DEL DAÑO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1187, 340, 'SEGUROS Y FIANZAS DE EQUIPO DE TRANSPORTE', 'ASIGNACIONES DESTINADAS A CUBRIR EL IMPORTE DE PRIMAS POR SEGUROS Y FIANZAS, CONTRATADOS A TERCEROS A FIN DE RESGUARDAR  CONTRA ROBOS, INCENDIOS Y  DEMAS RIESGOS O CONTINGENCIAS A QUE PUEDA ESTAR SUJETO EL EQUIPO DE TRANSPORTE REGISTRADO EN LOS ACTIVOS A CARGO DE LAS ENTIDADES. SE EXCLUYE EL MONTO DE LOS DEDUCIBLES CORRESPONDIENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1188, 341, 'SEGUROS Y FIANZAS DE EDIFICIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL IMPORTE DE PRIMAS POR SEGUROS Y FIANZAS, CONTRATADOS A TERCEROS A FIN DE RESGUARDAR EL PATRIMONIO INMOBILIARIO A CARGO DEL PODER JUDICIAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1189, 342, 'PRIMAS DE SEGUROS Y FIANZAS', 'CANTIDADES  DESTINADAS A CUBRIR EL IMPORTE DE PRIMAS DE SEGUROS Y FIANZAS DE EQUIPO DE COMPUTO, BIENES ARTISTICOS, ENTRE OTROS QUE REQUIERA EL PODER JUDICIAL. SE EXCLUYE EL PAGO DE SEGUROS Y FIANZAS DE EQUIPO DE TRANSPORTE Y SEGUROS Y FIANZAS DE EDIFICIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1190, 343, 'ALMACENAJE, ENVASE Y EMBALAJE', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LOS SERVICIOS DE ALMACENAMIENTO, EMBALAJE, DESEMBALAJE, ENVASE Y DESENVASE DE TODA CLASE DE OBJETOS, ARTICULOS, MATERIALES, MOBILIARIO, ENTRE OTROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1191, 344, 'FLETES, ACARREOS Y ENVIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR TRASLADO Y MANIOBRAS DE EMBARQUE Y DESEMBARQUE DE TODA CLASE DE ARTICULOS, MATERIALES, ANIMALES, PLANTAS, MOBILIARIO, ENTRE OTROS,  QUE REQUIERA EL PODER JUDICIAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1192, 345, 'COMISIONES POR VENTAS', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE COMISIONES A PERSONAS FISICAS, YA SEAN: PROFESIONISTAS, TECNICO, EXPERTOS O PERITOS, ASI COMO A LAS PERSONAS MORALES, CON LAS CUALES SE TENGA CELEBRADO CONTRATO RESPECTIVO, POR LOS SERVICIOS DE VENTA PRESTADOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1193, 346, 'SERVICIOS FINANCIEROS, BANCARIOS Y COMERCIALES INTEGRALES', 'OTROS SERVICIOS FINANCIEROS, BANCARIOS Y COMERCIALES NO PREVISTOS EN LAS DEMAS PARTIDAS ANTERIORES DE ESTE CONCEPTO. INCLUYE CASETAS TELEFONICAS SIN OPERAR LAS REDES ALAMBRICAS, RECEPCION DE LLAMADAS TELEFONICAS Y PROMOCION POR TELEFONO DE BIENES Y SERVICIOS, DE RECEPCION DE LLAMADAS TELEFONICAS EN NOMBRE DE LOS CLIENTES. EXCLUYE: CALCULO DE IMPUESTOS Y PREPARACION DE FORMATOS PARA LA DECLARACION DE IMPUESTOS, AL PROCESAMIENTO DE DATOS, A LA OPERACION DE REDES DE TELEFONIA TRADICIONAL, VENTA DE PRODUCTOS POR TELEFONO, Y A LOS SERVICIOS DE CORREO ELECTRONICO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1194, 347, 'CONSERVACION Y MANTTO. MENOR DE INMUEBLES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE CONSERVACION Y MANTENIMIENTO MENOR DE EDIFICIOS, LOCALES, TERRENOS, PREDIOS, AREAS VERDES Y CAMINOS DE ACCESO, PROPIEDAD O AL SERVICIO DEL PODER JUDICIAL, CUANDO SE EFECTUEN POR CUENTA DE TERCEROS, INCLUIDO EL PAGO DE DEDUCIBLES DE SEGUROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1195, 348, 'INSTALACION, MANTTO. Y REPARACION DE MOBILIARIO Y EQUIPO DE ADMINISTRACION', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE INSTALACION, REPARACION Y MANTENIMIENTO DE TODA CLASE DE MOBILIARIO Y EQUIPO DE ADMINISTRACION, TALES COMO: ESCRITORIOS, SILLAS, SILLONES, ARCHIVEROS, MAQUINAS DE ESCRIBIR, CALCULADORAS, FOTOCOPIADORAS, ENTRE OTROS. INCLUYE EL PAGO DE DEDUCIBLES DE SEGUROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1196, 349, 'INSTALACION, MANTTO. Y REPARACION DE BIENES ARTISTICOS Y CULTURALES', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR MANTENIMIENTO Y CONSERVACION DE  BIENES MUEBLES,  ARTISTICOS O CULTURALES COMO SON: PINTURAS, ESCULTURAS, CUADROS, COLECCIONES DIVERSAS, EDICIONES HISTORICAS, EQUIPOS MUSICALES PARA BANDAS Y ORQUESTAS, Y EN GENERAL TODOS LOS BIENES QUE CONSTITUYAN EL ACERVO PATRIMONIAL ARTISTICO Y CULTURAL, ASIGNADOS AL PODER JUDICIAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
