(1199, 352, 'INSTALACION, MANTTO. Y REP. DE EQUIPO INSTRUMENTAL MEDICO Y DE LABORATORIO', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE INSTALACION, REPARACION Y MANTENIMIENTO DE EQUIPO E INSTRUMENTAL MEDICO Y DE LABORATORIO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1200, 353, 'MANTTO. Y REPARACION DE EQUIPO DE TRANSPORTE', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE REPARACION Y MANTENIMIENTO DEL EQUIPO DE TRANSPORTE TERRESTRE, AEROESPACIAL, MARITIMO, LACUSTRE Y FLUVIAL, E INSTALACION DE EQUIPOS EN LOS MISMOS, PROPIEDAD O AL SERVICIO DEL PODER JUDICIAL. (EXCLUYE CAUSAS IMPUTABLES A SERVIDORES PUBLICOS)', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1201, 354, 'MANTTO. Y REPARACION DE EQUIPO DE DEFENSA Y SEGURIDAD', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DEL SERVICIO DE MANO DE OBRA Y/O PIEZAS NECESARIAS PARA LA CONSERVACION DE ARMAMENTO EN GENERAL, ASIGNADO A LAS ENTIDADES DEL GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1202, 355, 'INSTALACION, MANTTO. Y REPARACION DE MAQUINARIA  OTROS EQUIPOS Y HERRAMIENTA', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE INSTALACION, REPARACION Y MANTENIMIENTO DE LA MAQUINARIA, OTROS EQUIPOS Y HERRAMIENTA, PROPIEDAD O AL SERVICIO DE LOS ENTES PUBLICOS TALES COMO: TRACTORES, PALAS MECANICAS, DRAGAS, FERTILIZADORAS, VEHICULOS, EQUIPO ESPECIALIZADO INSTALADO EN LOS INMUEBLES, ENTRE OTROS, CUANDO SE EFECTUEN POR CUENTA DE TERCEROS. INCLUYE EL MANTENIMIENTO DE PLANTAS E INSTALACIONES PRODUCTIVAS Y EL PAGO DE DEDUCIBLES DE SEGUROS. (EXCLUYE CAUSAS IMPUTABLES A SERVIDORES PUBLICOS)', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1203, 356, 'INSTALACION, MANTTO. Y REPARACION DE HERRAMIENTAS Y OTROS EQUIPOS (INHABILITADA)', 'ASIGNACIONES DESTINADAS A CUBRIR EL MANTENIMIENTO DE TODA CLASE DE HERRAMIENTAS PROPIEDAD O AL SERVICIO DEL PODER JUDICIAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
(1204, 357, 'SERVICIOS DE LAVANDERIA, HIGIENE Y MANEJO DE DESECHOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR EL SERVICIO DE: LAVANDERIA, TINTORERIA, LIMPIEZA, DESINFECCION E HIGIENE DE LAS INSTALACIONES PERTENECIENTES AL PODER JUDICIAL QUE POR LA NATURALEZA DE SUS FUNCIONES LO REQUIERAN. INCLUYE SERVICIOS DE DRENAJE Y RECOLECCION DE BASURA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 162),
