(1261, 13, 'SUELDOS A PERSONAL ADSCRITO EN EL EXTRANJERO', 'ASIGNACIONES DESTINADAS A CUBRIR LAS REMUNERACIONES DEL PERSONAL QUE LABORA EN REPRESENTACIONES ESTATALES EN EL EXTRANJERO. INCLUYE LAS VARIACIONES DEL FACTOR DE AJUSTE: IMPORTANCIA RELATIVA DE LA OFICINA DE ADSCRIPCION; COSTO DE LA VIDA EN EL LUGAR DE ADSCRIPCION Y CONDICIONES DE DIFICULTAD DE LA VIDA EN CADA ADSCRIPCION. DICHAS REMUNERACIONES SON CUBIERTAS EXCLUSIVAMENTE AL PERSONAL QUE LABORE EN ESAS REPRESENTACIONES EN EL EXTERIOR.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1262, 14, 'HONORARIOS ASIMILABLES A SALARIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO POR LA PRESTACION DE SERVICIOS CONTRATADOS POR LOS ORGANOS AUTONOMOS CON PERSONAS FISICAS, COMO PROFESIONISTAS, TECNICOS, EXPERTOS Y PERITOS, ENTRE OTROS, POR ESTUDIOS, OBRAS O TRABAJOS DETERMINADOS QUE CORRESPONDAN A SU ESPECIALIDAD. EL PAGO DE HONORARIOS DEBERA SUJETARSE A LAS DISPOSICIONES APLICABLES. ESTA PARTIDA EXCLUYE LOS SERVICIOS PROFESIONALES CONTRATADOS CON PERSONAS FISICAS O MORALES PREVISTOS EN EL CAPITULO 3000 SERVICIOS GENERALES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
