(1521, 382, 'REUNIONES, CONGRESOS Y CONVENCIONES', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE PREPARACION Y DESARROLLO DE CONGRESOS, ASAMBLEAS, REUNIONES DE TRABAJO Y CONVENCIONES; ACONDICIONAMIENTO DEL LOCAL; ALQUILER DE LOCAL Y EQUIPO; PAGO DE INDEMNIZACIONES POR DAÑOS QUE EVENTUALMENTE SUFRAN LOS BIENES UTILIZADOS EN LAS MISMAS, COSTO DE TRANSMISIONES POR RADIO Y TELEVISION, CUOTAS DE INSCRIPCION A CONGRESOS Y CONVENCIONES; INVITACIONES, ALIMENTACION, HOSPEDAJE Y TRANSPORTE DE LOS PARTICIPANTES; PROPAGANDA; HONORARIOS Y GRATIFICACIONES POR SERVICIOS PROFESIONALES INDEPENDIENTES DE MAESTROS DE CEREMONIAS, EDECANES Y TRADUCTORES; ENTRE OTROS. NO PROCEDERA CARGARSE A ESTA PARTIDA COMPRA O MANTENIMIENTO DE MOBILIARIO, EQUIPO O DEMAS ACTIVO FIJO, MATERIAL DE OFICINA Y EN GENERAL GASTOS DE OPERACION NORMAL DE LOS ORGANOS AUTONOMOS (GASTO CORRIENTE).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1522, 383, 'EXPOSICIONES Y ESPECTACULOS', 'CANTIDADES DESTINADAS A CUBRIR LOS GASTOS QUE SE GENEREN EN EL MONTAJE DE ESPECTACULOS Y EXPOSICIONES: ALQUILER DE LOCAL Y EQUIPO, SEGURO, INSTALACION, GASTOS DE ALIMENTACION Y HOSPEDAJE DE EXPOSITORES, INVITACIONES, PROPAGANDA, COSTO DE TRANSMISION POR RADIO Y TELEVISION, CUOTAS DE INSCRIPCION, EDECANES, ENTRE OTROS; PAGO DE INSUMOS Y SERVICIOS QUE SE REQUIERAN DIRECTAMENTE PARA LA REALIZACION DEL EVENTO, ADAPTACION Y DECORACIONES, ALOJAMIENTO DE ASISTENTES FORANEOS, COSTO DE ALIMENTOS, HONORARIOS A MAESTROS DE CEREMONIAS, ACTORES Y GRUPOS MUSICALES, ENTRE OTROS, QUE INCIDAN DIRECTAMENTE CON EL DESARROLLO DE DICHOS EVENTOS. INCLUYE EL PAGO DE INDEMNIZACIONES POR LOS DAÑOS QUE SUFRAN LOS BIENES EXPUESTOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1523, 385, 'GASTOS DE REPRESENTACION', 'ASIGNACIONES DESTINADAS A CUBRIR GASTOS AUTORIZADOS A LOS SERVIDORES PUBLICOS DE MANDOS MEDIOS Y SUPERIORES POR CONCEPTO DE ATENCION A ACTIVIDADES INSTITUCIONALES ORIGINADAS POR EL DESEMPEÑO DE LAS FUNCIONES ENCOMENDADAS PARA LA CONSECUCION DE LOS OBJETIVOS DE LOS ORGANOS AUTONOMOS', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1524, 386, 'PAGOS DE DEFUNCION', 'ASIGNACIONES DESTINADAS A CUBRIR SERVICIOS Y PAGAS DE DEFUNCION COMO TRASLADO DE CUERPOS, VELACION, APOYO PARA TRAMITES LEGALES, CREMACION Y EMBALSAMIENTO Y ATAUDES, A LOS FAMILIARES DE SERVIDORES PUBLICOS, CIVILES Y MILITARES AL SERVICIO DE LOS ENTES PUBLICOS, ASI COMO DE PENSIONISTAS DIRECTOS, CUYO PAGO ES CON CARGO AL ERARIO. INCLUYE LOS GASTOS POR CONCEPTO DE HONORES POSTUMOS A QUIENES POR SUS MERITOS O SERVICIOS SE CONSIDERE CONVENIENTE TRIBUTAR.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1525, 387, 'IMPUESTOS y DERECHOS', 'CANTIDADES DESTINADAS A CUBRIR IMPUESTOS O DERECHOS CON MOTIVO DEL USO O SERVICIO DE RADIOCOMUNICACIONES; LEGALIZACION DE EXHORTOS, DE REGISTRO PUBLICO DE LA PROPIEDAD, IMPUESTO PREDIAL Y TRASLADO DE DOMINIO;  ASI COMO DERECHOS POR LA PRESTACION DE SERVICIOS, SE INCLUYEN GASTOS AEROPORTUARIOS (ESPACIO AEREO, ATERRIZAJE , REGUARDO DE AERONAVES ASI COMO AQUELLOS GASTOS QUE SE GENEREN PARA EL TRAMITE DE DERECHOS QUE SE REALICEN A DIFERENTES INSTANCIAS POR EL USO DE LAS AERONAVES)', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1526, 388, 'IMPUESTOS Y DERECHOS VEHICULARES', 'CANTIDADES DESTINADAS A CUBRIR GASTOS POR CANJE DE PLACAS,  REGISTRO DE CONTROL  VEHICULAR, IMPUESTOS Y TENENCIA DE VEHICULOS DE LOS ORGANOS AUTONOMOS, ENTRE OTROS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1527, 389, 'IMPUESTOS Y  DERECHOS DE IMPORTACION', 'ASIGNACIONES DESTINADAS A CUBRIR LOS IMPUESTOS Y/O DERECHOS QUE CAUSE LA ADQUISICION DE TODA CLASE DE BIENES O SERVICIOS EN EL EXTRANJERO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1528, 390, 'SENTENCIAS Y RESOLUCIONES JUDICIALES', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE OBLIGACIONES O INDEMNIZACIONES DERIVADAS DE RESOLUCIONES EMITIDAS POR LA  AUTORIDAD COMPETENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1529, 391, 'PENAS, MULTAS, ACCESORIOS Y ACTUALIZACIONES', 'ASIGNACIONES DESTINADAS A CUBRIR LAS EROGACIONES DERIVADAS DEL PAGO EXTEMPORANEO DE PASIVOS FISCALES, ADEUDOS U OBLIGACIONES DE PAGO, COMO MULTAS, ACTUALIZACIONES, INTERESES Y DEMAS ACCESORIOS POR DICHOS PAGOS. INCLUYE LOS GASTOS FINANCIEROS POR PAGO EXTEMPORANEO DE ESTIMACIONES Y DE AJUSTE DE COSTOS DE OBRA PUBLICA, ASI COMO LOS GASTOS NO RECUPERABLES DERIVADOS DE LA TERMINACION ANTICIPADA DE CONTRATOS DE ADQUISICIONES U OBRAS PUBLICAS. EXCLUYE CAUSAS IMPUTABLES A SERVIDORES PUBLICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1530, 392, 'PERDIDAS AL ERARIO Y OTROS GASTOS POR RESPONSABILIDAD', 'EROGACIONES DE LOS ORGANOS AUTONOMOS QUE SE DERIVEN DEL ROBO O EXTRAVIO, ENTRE OTROS, DE RECURSOS PUBLICOS QUE NO SEAN RECUPERABLES E IMPLIQUEN AFECTAR SU TECHO PRESUPUESTARIO DISPONIBLE. EXCLUYE LAS RECUPERACIONES DE RECURSOS QUE SE REALICEN POR LOS DIVERSOS MEDIOS ESTABLECIDOS POR LAS DISPOSICIONES APLICABLES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1531, 393, 'UTILIDADES', 'ASIGNACIONES DESTINADAS POR LAS EMPRESAS DE PARTICIPACION ESTATAL AL PAGO DE UTILIDADES, EN LOS TERMINOS DE LAS DISPOSICIONES APLICABLES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1532, 394, 'IMPUESTO SOBRE NOMINAS BASE', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LOS ORGANOS AUTONOMOS DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE BASE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1533, 395, 'IMPUESTO SOBRE NOMINAS MMyS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LOS ORGANOS AUTONOMOS  DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE MANDOS MEDIOS Y SUPERIORES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1534, 396, 'IMPUESTO SOBRE NOMINAS CONTRATO', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LOS ORGANOS AUTONOMOS DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE CONTRATO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1535, 397, 'IMPUESTO SOBRE NOMINAS CONFIANZA', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LOS ORGANOS AUTONOMOS DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE CONFIANZA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1536, 398, 'IMPUESTO SOBRE NOMINAS CONTRATO CONFIANZA', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LOS ORGANOS AUTONOMOS DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE CONTRATO CONFIANZA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1537, 400, 'OTROS IMPUESTOS DERIVADOS DE RELACION LABORAL BASE', 'ASIGNACIONES DESTINADAS AL PAGO DE OTROS IMPUESTOS NO INCLUIDOS EN OTRAS PARTIDAS DERIVADOS DE LA RELACION LABORAL CON PERSONAL DE BASE DE LOS ORGANOS AUTONOMOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1538, 401, 'OTROS IMPUESTOS DERIVADOS DE RELACION LABORAL MMyS', 'ASIGNACIONES DESTINADAS AL PAGO DE OTROS IMPUESTOS NO INCLUIDOS DERIVADOS DE LA RELACION LABORAL CON PERSONAL DE MANDOS MEDIOS Y SUPERIORES DE LOS ORGANOS AUTONOMOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1539, 402, 'OTROS IMPUESTOS DERIVADOS DE RELACION LABORAL CONTRATO', 'ASIGNACIONES DESTINADAS AL PAGO DE OTROS IMPUESTOS NO INCLUIDOS DERIVADOS DE LA RELACION LABORAL CON PERSONAL DE CONTRATO DE LOS ORGANOS AUTONOMOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1540, 403, 'OTROS IMPUESTOS DERIVADOS DE RELACION LABORAL CONFIANZA', 'ASIGNACIONES DESTINADAS AL PAGO DE OTROS IMPUESTOS NO INCLUIDOS DERIVADOS DE LA RELACION LABORAL CON PERSONAL DE CONFIANZA DE LOS ORGANOS AUTONOMOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1541, 404, 'OTROS IMPUESTOS DERIVADOS DE RELACION LABORAL CONTRATO CONFIANZA', 'ASIGNACIONES DESTINADAS AL PAGO DE OTROS IMPUESTOS NO INCLUIDOS DERIVADOS DE LA RELACION LABORAL CON PERSONAL DE CONTRATO CONFIANZA DE LOS ORGANOS AUTONOMOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1542, 407, 'SERVICIOS PARA PROYECTOS PPS (INHABILITADA)', 'CANTIDADES DESTINADAS AL CUMPLIMIENTO DE OBLIGACIONES QUE ASUMIO EL ESTADO CON MOTIVO DE LA SUSCRIPCION DEL CONTRATO DE PRESTACION DE SERVICIOS DE LARGO PLAZO, PARA LA CREACION DE INFRAESTRUCTURA, EQUIPAMIENTO Y MANTENIMIENTO DE LAS CIUDADES ADMINISTRATIVA Y JUDICIAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1543, 408, 'OTROS SERVICIOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS SERVICIOS QUE CORRESPONDAN A ESTE CAPITULO, NO PREVISTOS EXPRESAMENTE EN LAS PARTIDAS ANTES DESCRITAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1544, 410, 'COMBURENTES DIVERSOS', 'ASIGNACIONES DESTINADAS AL SUMINISTRO DE COMBURENTES DIVERSOS, TALES COMO: PETROLEO, LEÑA, ETC., REQUERIDOS PARA EL DESEMPEÑO DE FUNCIONES OFICIALES DE LOS ORGANOS AUTONOMOS Y QUE NO ESTEN CONSIDERADOS EN OTRAS CLASIFICACIONES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1545, 411, 'IMPUESTO SOBRE NOMINAS HONORARIOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS PAGOS DEL IMPUESTO SOBRE NOMINAS A CARGO DE LAS DEPENDENCIAS DE CONFORMIDAD CON LA LEY DE HACIENDA DEL ESTADO VIGENTE, CORRESPONDIENTE A PERSONAL DE HONORARIOS DE LOS ORGANOS AUTONOMOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1546, 416, 'SUSCRIPCIONES OFICIALES', 'CANTIDADES DESTINADAS A CUBRIR LAS SUSCRIPCIONES EN EL PERIODICO OFICIAL DEL ESTADO Y DIARIO OFICIAL DE LA FEDERACION POR LOS EJECUTORES DE GASTO EN EL DESEMPEÑO DE SUS FUNCIONES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163),
(1547, 484, 'SERVICIOS DE APOYO ADMINISTRATIVO, FOTOCOPIADO E IMPRESION', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LA CONTRATACION DE SERVICIOS DE FOTOCOPIADO Y PREPARACION DE DOCUMENTOS; DIGITALIZACION DE DOCUMENTOS OFICIALES, FAX, ENGARGOLADO, ENMICADO, ENCUADERNACION, CORTE DE PAPEL, RECEPCION DE CORRESPONDENCIA Y OTROS AFINES. INCLUYE SERVICIOS DE APOYO SECRETARIAL, SERVICIOS DE ESTENOGRAFIA EN LOS TRIBUNALES, TRANSCRIPCION SIMULTANEA DE DIALOGOS PARA LA TELEVISION, REUNIONES Y CONFERENCIAS; SERVICIOS COMERCIALES NO PREVISTOS EN LAS DEMAS PARTIDAS ANTERIORES. INCLUYE SERVICIOS DE IMPRESION DE DOCUMENTOS OFICIALES NECESARIOS TALES COMO: PASAPORTES, CERTIFICADOS ESPECIALES, TITULOS DE CREDITO, FORMAS FISCALES Y FORMAS VALORADAS, Y DEMAS DOCUMENTOS PARA LA IDENTIFICACION, TRAMITES OFICIALES Y SERVICIOS A LA POBLACION; SERVICIOS DE IMPRESION Y ELABORACION DE MATERIAL INFORMATIVO, TALES COMO: PADRONES DE BENEFICIARIOS, REGLAS DE OPERACION, PROGRAMAS SECTORIALES, REGIONALES, ESPECIALES; INFORMES DE LABORES, MANUALES DE ORGANIZACION, DE PROCEDIMIENTOS Y DE SERVICIOS AL PUBLICO; DECRETOS, CONVENIOS, ACUERDOS, INSTRUCTIVOS, PROYECTOS EDITORIALES (LIBROS, REVISTAS Y GACETAS PERIODICAS),\r\n FOLLETOS, TRIPTICOS, DIPTICOS, CARTELES, MANTAS, ROTULOS, Y DEMAS SERVICIOS DE IMPRESION Y ELABORACION DE MATERIAL INFORMATIVO. INCLUYE GASTOS COMO: AVISOS, PRECISIONES, CONVOCATORIAS, EDICTOS, BASES, LICITACIONES, DIARIO OFICIAL, CONCURSOS Y ACLARACIONES, Y DEMAS INFORMACION EN MEDIOS MASIVOS. EXCLUYE LAS INSERCIONES DERIVADAS DE CAMPAÑAS PUBLICITARIAS Y DE COMUNICACION SOCIAL, LAS CUALES SE DEBERAN REGISTRAR EN LAS PARTIDAS CORRESPONDIENTES AL CONCEPTO 3600 SERVICIOS DE COMUNICACION SOCIAL Y PUBLICIDAD.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 163);
INSERT INTO `ppto4_part_especificas` (`id`, `PartidaEspecifica`, `PartidaEspecificaNombre`, `PartidaEspecificaDescripcion`, `created_at`, `updated_at`, `ppto3_part_generica_id`) VALUES
(1548, 473, 'TRANSFERENCIAS OTORGADAS A ORGANISMOS ENTIDADES PARAESTATALES NO EMPRESARIALES Y NO FINANCIERAS', 'ASIGNACIONES A ENTIDADES QUE NO PRESUPONEN LA CONTRAPRESTACION DE BIENES O SERVICIOS, DESTINADA A ENTIDADES PARAESTATALES NO EMPRESARIALES Y NO FINANCIERAS DE CONTROL PRESUPUESTARIO INDIRECTO, CON EL OBJETO DE FINANCIAR GASTOS INHERENTES A SUS FUNCIONES. ESTAS ENTIDADES CUENTAN CON PERSONALIDAD JURIDICA PROPIA Y EN GENERAL SE LES ASIGNO LA RESPONSABILIDAD DE PROVEER BIENES Y SERVICIOS A LA COMUNIDAD EN SU CONJUNTO O A LOS HOGARES INDIVIDUALMENTE EN TERMINOS NO DE MERCADO; FINANCIAN SUS ACTIVIDADES PRINCIPALMENTE MEDIANTE IMPUESTOS Y/O TRANSFERENCIAS QUE RECIBEN DE OTROS SECTORES GUBERNAMENTALES; DISTRIBUYEN SUS PRODUCTOS GRATUITAMENTE O A PRECIOS ECONOMICAMENTE NO SIGNIFICATIVOS CON RELACION A SUS COSTOS DE PRODUCCION.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 164),
(1549, 433, 'AYUDAS A MUNICIPIOS', 'ASIGNACIONES CONSISTENTES EN APOYOS ECONOMICOS DESTINADOS A FAVOR DE LOS MUNICIPIOS, CON LA FINALIDAD DE APOYARLOS EN SUS FUNCIONES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 165),
(1550, 434, 'SUBSIDIOS A LA PRODUCCION', 'ASIGNACIONES DESTINADAS A PROMOVER Y FOMENTAR LA PRODUCCION Y TRANSFORMACION DE BIENES Y SERVICIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 166),
(1551, 435, 'SUBSIDIOS A LA DISTRIBUCION', 'ASIGNACIONES DESTINADAS A LAS EMPRESAS PARA PROMOVER LA COMERCIALIZACION Y DISTRIBUCION DE LOS BIENES Y SERVICIOS BASICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 167),
(1552, 436, 'SUBSIDIOS A LA INVERSION', 'ASIGNACIONES DESTINADAS A LAS EMPRESAS PARA MANTENER Y PROMOVER LA INVERSION DE LOS SECTORES SOCIAL Y PRIVADO EN ACTIVIDADES ECONOMICAS ESTRATEGICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 168),
(1553, 437, 'SUBSIDIOS A LA PRESTACION DE SERVICIOS PUBLICOS', 'ASIGNACIONES DESTINADAS A LAS EMPRESAS PARA PROMOVER LA PRESTACION DE SERVICIOS PUBLICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 169),
(1554, 438, 'SUBSIDIOS PARA CUBRIR DIFERENCIALES DE TASAS DE INTERES', 'ASIGNACIONES DESTINADAS A LAS INSTITUCIONES FINANCIERAS PARA CUBRIR LOS DIFERENCIALES GENERADOS EN LAS OPERACIONES FINANCIERAS REALIZADAS PARA EL DESARROLLO Y FOMENTO DE ACTIVIDADES PRIORITARIAS; MEDIANTE LA APLICACION DE TASAS PREFERENCIALES EN LOS CREDITOS OTORGADOS, CUANDO EL FONDEO SE REALIZA A TASAS DE MERCADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 170),
(1555, 439, 'SUBSIDIOS A LA VIVIENDA', 'ASIGNACIONES DESTINADAS A OTORGAR SUBSIDIOS A TRAVES DE SOCIEDADES HIPOTECARIAS, FONDOS Y FIDEICOMISOS, PARA LA CONSTRUCCION Y ADQUISICION DE VIVIENDA, PREFERENTEMENTE A TASAS DE INTERES SOCIAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 171),
(1556, 440, 'SUBSIDIOS AL CONSUMO', 'ASIGNACIONES DESTINADAS A LAS EMPRESAS PARA MANTENER UN MENOR NIVEL EN LOS PRECIOS DE BIENES Y SERVICIOS DE CONSUMO BASICO QUE DISTRIBUYEN LOS SECTORES ECONOMICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 172),
(1557, 441, 'SUBSIDIOS A ENTIDADES FEDERATIVAS Y MUNICIPIOS', 'ASIGNACIONES DESTINADAS A FAVOR DE ENTIDADES FEDERATIVAS Y MUNICIPIOS CON LA FINALIDAD DE APOYARLOS EN SU FORTALECIMIENTO FINANCIERO Y, EN CASO DE DESASTRES NATURALES O CONTINGENCIAS ECONOMICAS, ASI COMO PARA DAR CUMPLIMIENTO A CONVENIOS SUSCRITOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 173),
(1558, 471, 'SUBSIDIO PARA EL FORTALECIMIENTO DEL DESEMPEÑO EN MATERIA DE SEGURIDAD PUBLICA (FORTASEG)', 'ASIGNACIONES DESTINADAS PARA REGISTRAR LOS SUBSIDIOS FEDERALES PREVISTOS PARA MUNICIPIOS PARA LA REALIZACION DE ACCIONES ENFOCADAS A LA SEGURIDAD PUBLICA MUNICIPAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 173),
(1559, 442, 'OTROS SUBSIDIOS', 'ASIGNACIONES QUE SE OTORGAN PARA EL DESARROLLO DE ACTIVIDADES PRIORITARIAS DE INTERES GENERAL A TRAVES DE LOS ENTES PUBLICOS A LOS DIFERENTES SECTORES DE LA SOCIEDAD, NO CONSIDERADOS EN OTRAS CLASIFICACIONES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 174),
(1560, 443, 'AYUDAS DIVERSAS', 'ASIGNACION EXTRAORDINARIA, NO REGULARIZABLE, OTORGADA DE MANERA URGENTE A LAS PERSONAS, FAMILIAS O GRUPOS SOCIALES A TRAVES DE LOS EJECUTORES DE GASTO, COMO MEDIDA ALTERNATIVA DE SEGURIDAD, ESTABILIDAD SOCIAL Y POLITICA DEL ESTADO DE OAXACA O POR VULNERABILIDAD Y ESTADO DE NECESIDAD DE GRUPOS Y PERSONAS. NO INCLUYE PRESTACIONES AL PERSONAL DE GOBIERNO DEL ESTADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 175),
(1561, 444, 'AYUDA PARA  UTILES ESCOLARES', 'ASIGNACIONES DESTINADAS A LA ENTREGA DE PAQUETES DE UTILES ESCOLARES PARA ALUMNOS DE EDUCACION BASICA EN ESCUELAS PUBLICAS EN EL ESTADO DE OAXACA, QUE NO RECIBAN APOYO DE PROGRAMAS CON FINES SIMILARES, TALES COMO: PROSPERA, CONAFE O CUALQUIER OTRO FEDERAL, ESTATAL O MUNICIPAL. CON LA FINALIDAD DE REDUCIR LA DESERCION, INCREMENTAR EL RENDIMIENTO  ESCOLAR, Y APOYAR A LA ECONOMIA DE LAS FAMILIAS OAXAQUEÑAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 175),
(1562, 445, 'APOYO A DISCAPACITADOS', 'ASIGNACIONES DESTINADAS A CONTRIBUIR A LA PROTECCION SOCIAL Y A MEJORAR EL NIVEL DE VIDA DE LAS PERSONAS CON DISCAPACIDAD  MOTRIZ QUE VIVAN EN SITUACION DE POBREZA, MEDIANTE EL INCREMENTO DEL INGRESO DE FAMILIAS RESIDENTES EN EL ESTADO DE OAXACA QUE CUENTEN ENTRE SUS MIEMBROS CON UNA O MAS PERSONAS CON DISCAPACIDAD MOTRIZ, QUE VIVAN EN SITUACION DE POBREZA, SIEMPRE Y CUANDO NO GOCEN DE LOS BENEFICIOS O SEAN ATENDIDOS POR OTRO PROGRAMA ESTATAL, FEDERAL O MUNICIPAL, QUE TENGA CARACTERISTICAS U OBJETIVOS SIMILARES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 175),
(1563, 446, 'AYUDA PARA LA PREVENCION AL VIRUS DEL PAPILOMA HUMANO', 'ASIGNACIONES DESTINADAS A DISMINUIR LAS TASAS DE MORBILIDAD Y MORTALIDAD POR CANCER CERVICO-UTERINO EN LA POBLACION CON MAYOR RIESGO EPIDEMIOLOGICO EN EL ESTADO DE OAXACA', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 175),
(1564, 447, 'AYUDAS PARA ADULTOS MAYORES', 'ASIGNACIONES DESTINADAS A CONTRIBUIR A LA PROTECCION SOCIAL DE LAS MUJERES Y HOMBRES DE 70 Y MAS AÑOS, QUE VIVAN EN LOCALIDADES DEL ESTADO DE OAXACA CON POBLACION MAYOR A 30,000 HABITANTES. SIEMPRE Y CUANDO NO GOCEN DE LOS BENEFICIOS DEL PROGRAMA 70 Y MAS, NI DEL PROGRAMA OPORTUNIDADES O DE CUALQUIER OTRO APOYO FEDERAL, ESTATAL O MUNICIPAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 175),
(1565, 448, 'AYUDA AL IMPULSO DE JEFAS DE FAMILIA DESEMPLEADAS', 'ASIGNACIONES DESTINADAS A  BECAS  ECONOMICAS TEMPORALES QUE COADYUVE AL SUSTENTO DE HIJOS E HIJAS DE MADRES DE FAMILIA DESEMPLEADAS, MIENTRAS ENCUENTRAN UN NUEVO TRABAJO; CONTRIBUYENDO A LA PROTECCION SOCIAL DE LAS MADRES JEFAS DE FAMILIA QUE HAYAN PERDIDO SU EMPLEO EN EL SECTOR FORMAL, POR CAUSAS AJENAS A SU VOLUNTAD Y QUE NO PERCIBAN OTROS INGRESOS ECONOMICOS POR CONCEPTO DE JUBILACION, PENSION, SUBSIDIO O RELACION LABORAL DIVERSA Y QUE NO GOCEN DE LOS BENEFICIOS O SEAN ATENDIDAS POR OTRO PROGRAMA ESTATAL, FEDERAL O MUNICIPAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 175),
