(1668, 207, 'MATERIAL DE LIMPIEZA', 'ASIGNACIONES DESTINADAS A LA ADQUISICION DE MATERIALES, ARTICULOS Y ENSERES PARA EL ASEO, LIMPIEZA E HIGIENE;  TALES COMO: ESCOBAS, JERGAS, DETERGENTES, JABONES Y OTROS PRODUCTOS SIMILARES. (NO PROCEDE CARGAR A ESTA PARTIDA EL COSTO DE MANO DE OBRA).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1669, 208, 'SUMINISTROS DIVERSOS', 'CANTIDADES DE POCA CUANTIA DESTINADAS A CUBRIR EL IMPORTE DE MATERIALES Y SUMINISTROS QUE NO ESTEN CONSIDERADOS EN LAS CLASIFICACIONES ANTERIORES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1670, 210, 'MATERIALES PARA EL REGISTRO E IDENTIFICACION DE BIENES Y PERSONAS', 'CANTIDADES DESTINADAS A LA ADQUISICION DE FORMATOS REQUERIDOS PARA EL REGISTRO E IDENTIFICACION EN BIENES Y PERSONAS ADSCRITAS A LOS FIDEICOMISOS, TALES COMO:  PLACAS DE INVENTARIOS, CREDENCIALES OFICIALES, ENTRE OTRAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1671, 230, 'MATERIAL ELECTRICO Y ELECTRONICO', 'ASIGNACIONES DESTINADAS A LA ADQUISICION DE TODO TIPO DE MATERIAL ELECTRICO Y ELECTRONICO PARA LA ADAPTACION, CONSERVACION Y OPERACION DE OFICINAS PUBLICAS, TALES COMO: CABLES, INTERRUPTORES, TUBOS FLUORESCENTES, FOCOS, AISLANTES, ELECTRODOS, TRANSISTORES, ALAMBRES, LAMPARAS, ENTRE OTROS, QUE REQUIERAN LAS LINEAS DE TRANSMISION TELEGRAFICA, TELEFONICA, ELECTRICA Y DE TELECOMUNICACIONES, SEAN AEREAS O SUBTERRANEAS; IGUALMENTE LA ADQUISICION DE MATERIALES NECESARIOS EN LAS INSTALACIONES RADIOFONICAS, RADIOTELEGRAFICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1672, 241, 'COMBUSTIBLES, LUBRICANTES Y ADITIVOS', 'ASIGNACIONES DESTINADAS A LA ADQUISICION DE TODO TIPO DE SUSTANCIAS REQUERIDAS PARA EL FUNCIONAMIENTO DE TODA CLASE DE VEHICULOS DE MOTOR, EQUIPO Y MAQUINARIA, TALES COMO: GASOLINA, DIESEL, LEÑA, GASAVION, TURBOSINA, GRASAS LUBRICANTES, ACEITES, ADITIVOS, LIQUIDO PARA FRENOS, ENTRE OTROS. INCLUYE ETANOL Y BIOGAS.  EXCLUYE EL PETROLEO CRUDO Y GAS NATURAL, ASI COMO LOS COMBUSTIBLES UTILIZADOS COMO MATERIA PRIMA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1673, 259, 'REFACCIONES Y ACCESORIOS  MENORES PARA EQUIPO DE TRANSPORTE', 'ASIGNACIONES DESTINADAS A LA ADQUISICION DE REFACCIONES Y ACCESORIOS PARA EQUIPO DE TRANSPORTE TALES COMO: LLANTAS, SUSPENSIONES, SISTEMAS DE FRENOS, PARTES ELECTRICAS, ALTERNADORES, DISTRIBUIDORES, PARTES DE SUSPENSION Y DIRECCION, SISTEMAS DE FRENOS, MARCHAS, EMBRAGUES, RETROVISORES, LIMPIADORES, VOLANTES, TAPETES REFLEJANTES, GATOS HIDRAULICOS O MECANICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1674, 263, 'MATERIAL DE INSTALACIONES', 'ASIGNACIONES DESTINADAS A LA ADQUISICION DE MATERIAL PARA INSTALACIONES DE AIRE ACONDICIONADO,  SEÑALIZACION DE RUTAS DE EVACUACION O PROTECCION CIVIL EN EDIFICIOS PUBLICOS; ENTRE OTROS. (NO PROCEDE CARGAR A ESTA PARTIDA EL COSTO DE MANO DE OBRA NI LA ADQUISICION DE MATERIAL ELECTRICO Y DE PLOMERIA).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1675, 301, 'ENERGIA ELECTRICA', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR LA CONTRATACION Y SERVICIO DE ENERGIA ELECTRICA, ASI COMO LA CONTRATACION DE PLANTAS DE LUZ, NECESARIOS PARA EL FUNCIONAMIENTO DE LAS INSTALACIONES OFICIALES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1676, 303, 'AGUA', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR LA CONTRATACION Y SERVICIO DE AGUA POTABLE (AGUA ENVASADA, AGUA QUE SE DISTRIBUYE EN PIPAS O CARROS TANQUE PARA USO HUMANO),\r\n QUE  UTILIZAN LOS FIDEICOMISOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1677, 304, 'TELEFONO CONVENCIONAL', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR LA CONTRATACION Y SERVICIO DE TELEFONIA CONVENCIONAL, REQUERIDO PARA EL DESEMPEÑO DE FUNCIONES OFICIALES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
