(1679, 306, 'SERVICIOS DE TELECOMUNICACIONES Y SATELITES', 'ASIGNACIONES DESTINADAS A CUBRIR EL PAGO DE SERVICIOS DE LA RED DE TELECOMUNICACIONES NACIONAL E INTERNACIONAL, REQUERIDOS EN EL DESEMPEÑO DE FUNCIONES OFICIALES. INCLUYE LA RADIOLOCALIZACION UNIDIRECCIONAL O SISTEMA DE COMUNICACION PERSONAL Y SELECTIVA DE ALERTA, SIN MENSAJE, O CON UN MENSAJE DEFINIDO COMPUESTO POR CARACTERES NUMERICOS O ALFANUMERICOS. INCLUYE SERVICIOS DE CONDUCCION DE SEÑALES DE VOZ, DATOS E IMAGEN REQUERIDOS EN EL DESEMPEÑO DE FUNCIONES OFICIALES, TALES COMO: SERVICIOS SATELITALES, RED DIGITAL INTEGRADA Y DEMAS SERVICIOS NO CONSIDERADOS EN LAS REDES TELEFONICAS Y DE TELECOMUNICACIONES NACIONAL E INTERNACIONAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1680, 307, 'INTERNET, REDES Y PROCESAMIENTO DE INFORMACION', 'ASIGNACIONES DESTINADAS A CUBRIR EL SERVICIO DE ACCESO A INTERNET Y SERVICIOS PRESTADOS A TRAVES DE LA RED, TALES COMO HOSPEDAJE DE PAGINAS WEB, CORREO, DISEÑO DE PAGINAS WEB, ENTRE OTROS. ASI COMO EL MANEJO Y ADMINISTRACION DE APLICACIONES EN SERVIDORES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1681, 308, 'SERVICIO POSTAL Y TELEGRAFICO', 'ASIGNACIONES DESTINADAS AL PAGO DE SERVICIO POSTAL Y TELEGRAFICO, ASI COMO LOS PAGOS POR SERVICIO DE MENSAJERIA Y PAQUETERIA REQUERIDOS EN EL DESEMPEÑO DE FUNCIONES OFICIALES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1682, 311, 'ARRENDAMIENTO DE EDIFICIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL ALQUILER DE TODA CLASE DE EDIFICIOS E INSTALACIONES COMO: VIVIENDAS Y EDIFICACIONES NO RESIDENCIALES, SALONES PARA CONVENCIONES, OFICINAS Y LOCALES COMERCIALES, TEATROS, ESTADIOS, AUDITORIOS, BODEGAS, ENTRE OTROS, DESTINADOS AL SERVICIO OFICIAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
