(1684, 313, 'ARRENDAMIENTO DE MUEBLES PARA OFICINA', 'ASIGNACIONES DESTINADAS A CUBRIR EL ALQUILER DE TODA CLASE DE MOBILIARIO REQUERIDO EN EL CUMPLIMIENTO DE LAS FUNCIONES OFICIALES. INCLUYE BIENES Y EQUIPOS DE TECNOLOGIAS DE LA INFORMACION, TALES COMO: EQUIPO DE COMPUTO, IMPRESORAS, ENTRE OTRAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1685, 321, 'SERVICIOS LEGALES, DE CONTABILIDAD, AUDITORIA Y RELACIONADOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE SERVICIOS PROFESIONALES INDEPENDIENTES CONTRATADOS POR LOS FIDEICOMISOS PARA ASESORAMIENTO Y CONSULTORIA EN MATERIA JURIDICA, CONTABLE, INGENIERIA, ARQUITECTONICA Y AUDITORIA EXTERNA ENTRE OTROS, PARA EL MEJOR DESEMPEÑO DE SUS FUNCIONES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
