(1687, 332, 'COMISIONES Y SITUACIONES BANCARIAS', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DE TRASLADO, CUSTODIA DE VALORES Y SERVICIOS BANCARIOS NECESARIOS PARA EL MOVIMIENTO DE FONDOS. (SE EXCEPTUA EL PAGO DE COMISIONES POR SOBREGIRO).', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
