(1689, 340, 'SEGUROS Y FIANZAS DE EQUIPO DE TRANSPORTE', 'ASIGNACIONES DESTINADAS A CUBRIR EL IMPORTE DE PRIMAS POR SEGUROS Y FIANZAS, CONTRATADOS A TERCEROS A FIN DE RESGUARDAR  CONTRA ROBOS, INCENDIOS Y  DEMAS RIESGOS O CONTINGENCIAS A QUE PUEDA ESTAR SUJETO EL EQUIPO DE TRANSPORTE REGISTRADO EN LOS ACTIVOS A CARGO DE LAS ENTIDADES. SE EXCLUYE EL MONTO DE LOS DEDUCIBLES CORRESPONDIENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
