(1693, 353, 'MANTTO. Y REPARACION DE EQUIPO DE TRANSPORTE', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR SERVICIOS DE REPARACION Y MANTENIMIENTO DEL EQUIPO DE TRANSPORTE TERRESTRE, AEROESPACIAL, MARITIMO, LACUSTRE Y FLUVIAL, E INSTALACION DE EQUIPOS EN LOS MISMOS, PROPIEDAD O AL SERVICIO DE LOS FIDEICOMISOS. INCLUYE EL PAGO DE DEDUCIBLES DE SEGUROS. (EXCLUYE CAUSAS IMPUTABLES A SERVIDORES PUBLICOS)', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1694, 357, 'SERVICIOS DE LAVANDERIA, HIGIENE Y MANEJO DE DESECHOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR EL SERVICIO DE: LAVANDERIA, TINTORERIA, LIMPIEZA, DESINFECCION E HIGIENE DE LAS INSTALACIONES PERTENECIENTES A LAS ENTIDADES QUE POR LA NATURALEZA DE SUS FUNCIONES LO REQUIERAN. INCLUYE SERVICIOS DE DRENAJE Y RECOLECCION DE BASURA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1695, 362, 'PUBLICACION Y DIVULGACION DE MENSAJES PARA PROMOCION DE BIENES O SERVICIOS', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO DE LA PUBLICIDAD DERIVADA DE LA COMERCIALIZACION DE LOS PRODUCTOS O SERVICIOS DE LOS ENTES PUBLICOS QUE GENERAN UN INGRESO PARA EL ESTADO. EXCLUYE LOS GASTOS DE DIFUSION DE MENSAJES QUE NO COMERCIALIZAN PRODUCTOS O SERVICIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1696, 363, 'IMPRESOS Y PUBLICACIONES OFICIALES', 'CANTIDADES DESTINADAS A CUBRIR EROGACIONES POR PROMOCION, DIFUSION Y PUBLICIDAD  A TRAVES DE LOS DIVERSOS MEDIOS DE COMUNICACION PARA DAR A CONOCER LOS SERVICIOS QUE PRESTAN LOS FIDEICOMISOS; ASI COMO LA  IMPRESION DE PAPELERIA OFICIAL, VALES DE COMBUSTIBLES, SELLOS OFICIALES, MEMBRETES, FORMATOS, INSTRUCTIVOS, TRIPTICOS, CARTELES, TRABAJOS SERIGRAFICOS Y ENCUADERNACION DE MEMORIAS DE EVENTOS, PARA LA IDENTIFICACION Y REALIZACION DE TRAMITES ADMINISTRATIVOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
