(1699, 366, 'SERVICIOS DE LA INDUSTRIA FILMICA, DEL SONIDO Y DEL  VIDEO', 'ASIGNACIONES DESTINADAS A CUBRIR EL COSTO POR POSTPRODUCCION (DOBLAJE, TITULAJE, SUBTITULAJE, EFECTOS VISUALES, ANIMACION, EDICION, CONVERSION DE FORMATO, COPIADO DE VIDEOS, ENTRE OTROS) Y A OTROS SERVICIOS PARA LA INDUSTRIA FILMICA Y DEL VIDEO COMO LA CRESTOMATIA Y LOS SERVICIOS PRESTADOS POR LOS LABORATORIOS FILMICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1700, 367, 'SERVICIOS DE CREACION Y DIFUSION POR INTERNET', 'ASIGNACIONES DESTINADAS A CUBRIR EL GASTO POR CREACION, DIFUSION Y TRANSMISION DE CONTENIDO DE INTERES GENERAL O ESPECIFICO A TRAVES DE INTERNET EXCLUSIVAMENTE.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1701, 369, 'PASAJES AEREOS', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONCEPTO DE TRASLADO DE PERSONAL POR VIA AEREA QUE SE UTILICEN EN EL CUMPLIMIENTO DE SUS FUNCIONES PUBLICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1702, 370, 'PASAJES TERRESTRES', 'ASIGNACIONES DESTINADAS A CUBRIR LOS GASTOS POR CONCEPTO DE TRASLADO DE PERSONAL POR VIA TERRESTRE URBANO Y SUBURBANO, INTERURBANO Y RURAL, TAXIS Y FERROVIARIO, EN CUMPLIMIENTO DE SUS FUNCIONES PUBLICAS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1703, 372, 'AUTOTRANSPORTE', 'ASIGNACIONES DESTINADAS AL AUTOTRANSPORTE TANTO DE MERCANCIAS QUE NO REQUIEREN DE EQUIPO ESPECIALIZADO Y QUE NORMALMENTE SE TRANSPORTAN EN CAMIONES DE CAJA O EN CONTENEDORES, COMO DE AQUELLOS PRODUCTOS QUE POR SUS CARACTERISTICAS (LIQUIDOS, GASES, ETC.) REQUIEREN SER TRANSPORTADOS EN CAMIONES CON EQUIPO ESPECIALIZADO.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1704, 373, 'PEAJES Y PUENTES', 'CANTIDADES DESTINADAS A CUBRIR GASTOS CON MOTIVO DEL USO O SERVICIO DE CARRETERAS Y PUENTES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1705, 374, 'VIATICOS EN EL PAIS', 'ASIGNACIONES DESTINADAS A CUBRIR AL PERSONAL DE LOS FIDEICOMISOS, EL COSTO DE ALIMENTACION, HOSPEDAJE Y ARRENDAMIENTO DE VEHICULOS QUE POR NECESIDAD DEL SERVICIO TENGAN QUE TRASLADARSE A LUGARES DISTINTOS A LOS DE SU ADSCRIPCION, PARA EL CUMPLIMIENTO DE COMISIONES OFICIALES APLICANDO  PARA TAL CASO LAS CUOTAS QUE SEÑALE EL TABULADOR VIGENTE. EXCLUYE LOS GASTOS DE PASAJES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1706, 375, 'VIATICOS EN EL EXTRANJERO', 'ASIGNACION SUJETA A COMPROBACION DE ACUERDO A LA NORMATIVIDAD EN LA MATERIA, PARA CUBRIR LA ALIMENTACION, HOSPEDAJE Y ARRENDAMIENTO DE VEHICULOS DE LOS SERVIDORES PUBLICOS QUE POR COMISIONES DEBAN ASISTIR AL EXTRANJERO PARA CUMPLIR CON FUNCIONES PROPIAS DE SU ACTIVIDAD, APLICANDO PARA TAL CASO LAS CUOTAS QUE SEÑALE EL TABULADOR VIGENTE. EXCLUYE LOS GASTOS DE PASAJES.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
(1707, 378, 'GASTOS EN COMISION', 'CANTIDADES DESTINADAS A CUBRIR EL COSTO DE ALIMENTACION DEL PERSONAL QUE REALIZA TRABAJOS EXTRAORDINARIOS FUERA DEL HORARIO NORMAL DE LABORES, Y AQUELLOS QUE SE DERIVEN DE COMISIONES QUE NO AMERITE EL PAGO DE VIATICOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 189),
