INSERT INTO `ppto4_part_especificas` (`id`, `PartidaEspecifica`, `PartidaEspecificaNombre`, `PartidaEspecificaDescripcion`, `created_at`, `updated_at`, `ppto3_part_generica_id`) VALUES
(2049, 805, 'OTROS  CONCEPTOS PARTICIPABLES DE LA FEDERACION A  ENTIDADES FEDERATIVAS', 'ASIGNACIONES DESTINADAS A COMPENSAR LOS MONTOS CORRESPONDIENTES EN LOS FONDOS PREVISTOS EN LAS DEMAS PARTIDAS QUE, CONFORME A LA FORMULA ESTABLECIDA, SE ESTIMA DEBEN RECIBIR LOS MUNICIPIOS POR CONCEPTO DE RECAUDACION FEDERAL PARTICIPABLE. INCLUYE LAS ASIGNACIONES CUYA PARTICIPACION TOTAL EN LOS FONDOS GENERAL DE PARTICIPACIONES Y DE FOMENTO MUNICIPAL NO ALCANCE EL CRECIMIENTO ESPERADO EN LA RECAUDACION FEDERAL PARTICIPABLE; LAS ASIGNACIONES A LOS MUNICIPIOS QUE RESULTEN AFECTADAS POR EL CAMBIO EN LA FORMULA DE PARTICIPACIONES Y AQUELLAS DESTINADAS A CUBRIR EL PORCENTAJE DE LAS PARTICIPACIONES DERIVADO DE LA RECAUDACION DEL IMPUESTO ESPECIAL DE PRODUCCION Y SERVICIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 312),
(2050, 806, 'PARTICIPACIONES FONDO DE COMPENSACION', 'ES AQUEL QUE SE INTEGRA CON EL 2/11 DEL TOTAL RECAUDADO CON MOTIVO DE LA APLICACION DE LAS CUOTAS PREVISTAS EN EL ARTICULO 2º-A FRACCION II DE LA LEY DEL IMPUESTO ESPECIAL SOBRE PRODUCCION Y SERVICIOS, Y SE DISTRIBUIRA ENTRE LAS 10 ENTIDADES FEDERATIVAS QUE, DE ACUERDO CON LA ULTIMA INFORMACION DEL INSTITUTO NACIONAL DE ESTADISTICA, GEOGRAFIA E INFORMATICA, TENGAN LOS MENORES NIVELES DE PRODUCTO INTERNO BRUTO PER CAPITA NO MINERO Y NO PETROLERO. LOS MUNICIPIOS RECIBIRAN COMO MINIMO EL 20% DE LA RECAUDACION QUE CORRESPONDA A LAS ENTIDADES FEDERATIVAS. LA DISTRIBUCION DEL PORCENTAJE MENCIONADO POR PARTE DE LAS ENTIDADES FEDERATIVAS A LOS MUNICIPIOS DEBERA REALIZARSE CUANDO MENOS EN UN 70% ATENDIENDO A LOS NIVELES DE POBLACION. LOS RECURSOS DE ESTE FONDO DEBERAN DESTINARSE EXCLUSIVAMENTE A INFRAESTRUCTURA VIAL, SEA RURAL O URBANA; INFRAESTRUCTURA HIDRAULICA; MOVILIDAD URBANA, Y POR LO MENOS 12.5% A PROGRAMAS PARA PROTECCION Y CONSERVACION AMBIENTAL. LO ANTERIOR, CONFORME A LO ESTABLECIDO POR EL ARTICULO 4-A, FRACCION II DE LA LEY DE COORDINACION FISCAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 312),
(2051, 807, 'PARTICIPACIONES A LAS VENTAS FINALES DE GASOLINA Y DIESEL', 'ESTOS RECURSOS DERIVAN DEL TOTAL RECAUDADO DE LA APLICACION DE LAS CUOTAS PREVISTAS EN EL ARTICULO 2º-A, FRACCION II DE LA LEY DEL IMPUESTO ESPECIAL SOBRE PRODUCCION Y SERVICIOS (GASOLINAS Y DIESEL). DE DICHO TOTAL RECAUDADO 9/11 CORRESPONDE A LAS ENTIDADES FEDERATIVAS EN FUNCION DEL CONSUMO EFECTUADO EN SU TERRITORIO, SIEMPRE Y CUANDO SE ENCUENTREN ADHERIDAS AL SISTEMA NACIONAL DE COORDINACION FISCAL. EL ESTADO DE OAXACA TIENE DERECHO A RECIBIR ESTOS RECURSOS DE LA FEDERACION POR TENER CELEBRADO CON LA MISMA EL ANEXO 17 AL CONVENIO DE COLABORACION ADMINISTRATIVA EN MATERIA FISCAL FEDERAL RELATIVO A LAS FACULTADES OPERATIVAS DE ADMINISTRACION DE LOS INGRESOS DERIVADOS DE LAS CUOTAS CITADAS, MISMO QUE FUE PUBLICADO EN EL POGE Nº 8 DE 23 DE FEBRERO DE 2008. LO ANTERIOR, CONFORME A LO ESTABLECIDO POR EL ARTICULO 4-A, FRACCION I DE LA LEY DE COORDINACION FISCAL.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 312),
(2052, 808, 'OTROS CONCEPTOS PARTICIPABLES DE LA FEDERACION A MUNICIPIOS', 'ASIGNACIONES DESTINADAS A COMPENSAR LOS MONTOS CORRESPONDIENTES EN LOS FONDOS PREVISTOS EN LAS DEMAS PARTIDAS, QUE CONFORME A LA FORMULA ESTABLECIDA SE ESTIMA DEBEN RECIBIR LOS MUNICIPIOS POR CONCEPTO DE RECAUDACION FEDERAL PARTICIPABLE. INCLUYE LAS ASIGNACIONES CUYA PARTICIPACION TOTAL EN LOS FONDOS GENERAL DE PARTICIPACIONES Y DE FOMENTO MUNICIPAL NO ALCANCE EL CRECIMIENTO ESPERADO EN LA RECAUDACION FEDERAL PARTICIPABLE; LAS ASIGNACIONES A LOS MUNICIPIOS QUE RESULTEN AFECTADAS POR EL CAMBIO EN LA FORMULA DE PARTICIPACIONES, Y AQUELLAS DESTINADAS A CUBRIR EL PORCENTAJE DE LAS PARTICIPACIONES DERIVADO DE LA RECAUDACION DEL IMPUESTO ESPECIAL DE PRODUCCION Y SERVICIOS.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 313),
