(2055, 812, 'INFRAESTRUCTURA SOCIAL MUNICIPAL (FISM)', 'ASIGNACIONES DESTINADAS PARA OBRAS SOCIALES BASICAS TALES COMO: AGUA POTABLE, ALCANTARILLADO, DRENAJE Y LETRINAS, URBANIZACION MUNICIPAL, ELECTRIFICACION RURAL Y DE COLONIAS POBRES, INFRAESTRUCTURA BASICA DE SALUD, INFRAESTRUCTURA BASICA EDUCATIVA, MEJORAMIENTO DE VIVIENDA, CAMINOS RURALES E INFRAESTRUCTURA PRODUCTIVA RURAL, DESARROLLO INSTITUCIONAL Y ESTIMULO A LA EDUCACION BASICA.', '2023-03-22 10:23:04', '2023-03-22 10:23:04', 316),
